INSERT INTO `knowledges` (`knowledgesrno`, `maintopic`, `maintopicphoto`, `topicheading`, `topicphoto`, `topicdetails`, `written_at`) VALUES
(1, 'Cryptocurrency', 'cryptocurrency.jpg', 'What is Cryptocurrency?', '62746e5f8cfb5c5463a762167b30c504.jpeg', '<p>In simple terms, <strong><span style=\"color:#ff6842\"><u>cryptocurrency</u></span></strong> is a digital or <strong><span style=\"color:#ff6842\"><u>virtual currency</u></span></strong> that is meant to be a medium of exchange. It is marked by <span style=\"color:#ff6842\"><u><strong>decentralized control</strong></u></span>. (Decentralized-the activities of an organization, are distributed or pass on, away from a central authority, location or group.) Cryptocurrencies use <span style=\"color:#ff6842\"><u><strong>extremely complex code</strong></u></span> systems that encrypt sensitive data transfers, to secure their units of exchange. These protocols are built by the developers on advanced mathematics &amp; Computer Engineering principle which are virtually impossible to break &amp; thus it&rsquo;s difficult to imitate the protected currencies. Like real money it typically <span style=\"color:#ff6842\"><u><strong>doesn&rsquo;t exist</strong></u></span> in <span style=\"color:#ff6842\"><u><strong>physical form</strong></u></span> &amp; is also not issued by a central authority. Each Cryptocurrency works through distributed ledger technology, typically a <span style=\"color:#ff6842\"><u><strong>block chain</strong></u></span> that serves as a public financial transaction data base.<br />\r\nAs a consequence, what makes Cryptocurrency so special?<br />\r\nWell, firstly to answer that, it takes little to no transaction cost. While we are using digital wallet, we lose some amount of money. Also, with the use of Cryptocurrencies we have 24/7 access to our money. Cryptocurrencies can be <span style=\"color:#ff6842\"><u><strong>used by anyone</strong></u></span> as there is no need of paper work or documentation, like one need while opening an account in bank, this can be avoided with Cryptocurrencies.<br />\r\n<span style=\"color:#ff6842\"><u><strong>Bitcoin</strong></u></span>, First released as open-source software in <span style=\"color:#ff6842\"><u><strong>2009</strong></u></span>, is the <span style=\"color:#ff6842\"><u><strong>first decentralize</strong></u></span> Cryptocurrency. Since the release of Bitcoin, other Cryptocurrencies have been created.</p>', '2021-06-11 12:58:54'),
(2, 'Cryptocurrency', 'cryptocurrency.jpg', 'What is Crypto Mining?', 'b46126190e430a6c8377fd5b0d37f794.jpeg', '<p>In world, where does <span style=\"color:#ff6842\"><u><strong>gold and silver</strong></u></span> come from? Of course, it found in the <span style=\"color:#ff6842\"><u><strong>layers of earth</strong></u></span> &amp; is processed by mining. And if we see <span style=\"color:#ff6842\"><u><strong>rupees, dollars, euros, etc</strong></u></span>., we <span style=\"color:#ff6842\"><u><strong>mint</strong></u></span> them.<br />\r\n<strong>For example, Reserve Bank of India, they issue notes and coins, thus it is called minting &amp; the bank is called as mint</strong>. That&rsquo;s how when a <span style=\"color:#ff6842\"><u><strong>bitcoin</strong></u></span> is made, it called <span style=\"color:#ff6842\"><u><strong>minting</strong></u></span>. The process of making new <span style=\"color:#ff6842\"><u><strong>bitcoin</strong></u></span> is called as <span style=\"color:#ff6842\"><u><strong>mining</strong></u></span>. As cryptocurrencies are made from <span style=\"color:#ff6842\"><u><strong>complex algorithms</strong></u></span>, so its not as easy as printing as notes by printing machines. When mining takes place, there are three things going on, firstly the <span style=\"color:#ff6842\"><strong><u>miner</u></strong></span>, who is running the <span style=\"color:#ff6842\"><u><strong>mining software</strong></u></span> on computer, <span style=\"color:#ff6842\"><u><strong>time</strong></u></span> to do mining, of course; for that miner its kind of lottery system. In the whole world at a time 20,000 to 25,000 people are mining at the same time &amp; at a time only one individual is able to mine, so that&rsquo;s why I am calling it as a lottery process. Second thing is that in every <span style=\"color:#ff6842\"><u><strong>10 minutes</strong></u></span>, a block gets mine and a miner gets successful in mining. So, whenever, a block gets mine new <span style=\"color:#ff6842\"><u><strong>bitcoin is generated</strong></u></span>.<br />\r\nFor this effort,<span style=\"color:#ff6842\"><u><strong> successful miner obtains new cryptocurrency as a reward</strong></u></span>.<br />\r\nThe crypto miner competes with each other to solve complicated mathematical problem using high performance computers. Each problems uses <span style=\"color:#ff6842\"><u><strong>cryptographic hash</strong></u></span> functions that are associated with a <span style=\"color:#ff6842\"><u><strong>block containing</strong></u></span> a cryptocurrency transactions data.<br />\r\nThe first miner to crack each code is rewarded by being able to <span style=\"color:#ff6842\"><u><strong>authorize the transaction</strong></u></span>, &amp; in return for the service provided, cryptocurrencies earn small amount of cryptocurrency of their own. Once the crypto <span style=\"color:#ff6842\"><u><strong>miner successfully completes</strong></u></span> the mathematical problem &amp; <span style=\"color:#ff6842\"><u><strong>verifies the transaction information</strong></u></span>, they add the data to the <span style=\"color:#ff6842\"><u><strong>public block chain ledger</strong></u></span>.</p>', '2021-06-11 12:58:57'),
(3, 'Cryptocurrency', 'cryptocurrency.jpg', 'What is Blockchain?', '1ffbfcd033202a8d766403b412d5b8e4.jpeg', '<p>A <span style=\"color:#ff6842\"><u><strong>blockchain</strong></u></span> is a <span style=\"color:#ff6842\"><u><strong>chain of blocks</strong></u></span> that contains information. It is a <span style=\"color:#ff6842\"><u><strong>distributed ledger</strong></u></span> that is completely open to anyone. There is an interesting property about blockchain that once some data has been recorded in blockchain, it becomes very difficult to change it. The blockchain itself, is a<span style=\"color:#ff6842\"><strong> <u>series of block</u></strong></span> that are listed in <span style=\"color:#ff6842\"><u><strong>chronological order</strong></u></span>. Because previously published blocks<span style=\"color:#ff6842\"><strong> </strong><u><strong>cannot be modified or altered</strong></u></span> after they have been <span style=\"color:#ff6842\"><u><strong>added to the blockchain</strong></u></span>, this provides a level of transparency. After all everyone can see the transactions. A cryptocurrency transaction technically is not finalized until it&rsquo;s added to the blockchain. The blockchain thus prevents double spending, or the exploitation of cryptocurrency code to allow the same currency units to be duplicated &amp; sent to multiple receipts. Also, blockchain is very<strong> </strong><span style=\"color:#ff6842\"><u><strong>difficult to hack</strong></u></span> as hackers need to hack a thousand or more computer at a time. That&rsquo;s why we considered it as a <span style=\"color:#ff6842\"><u><strong>safe &amp; secure</strong></u></span> technology.</p>', '2021-06-11 12:59:00'),
(4, 'Elon Musk', 'elonmusk.jpg', 'Who is he?', '4d7b89e17014491ed447e4f32c2198ff.jpeg', '<p>Elon Musk is the founder, CEO and Chief Engineer at <span style=\"color:#ff6842\"><u><strong>SpaceX</strong></u></span>, early stage investor, CEO, and Product Architect of <span style=\"color:#ff6842\"><u><strong>Tesla</strong></u></span>, Inc. founder of The <span style=\"color:#ff6842\"><u><strong>Boring Company</strong></u></span> and co-founder of <span style=\"color:#ff6842\"><u><strong>Neuralink</strong></u></span> and <span style=\"color:#ff6842\"><u><strong>OpenAI</strong></u></span>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2021-06-11 14:24:17'),
(5, 'Elon Musk', 'elonmusk.jpg', 'Early Life', 'c2168c94c505182b957476739b04a7e4.jpeg', '<p>Elon Musk was born to a Canadian mother &amp; South African father &amp; raised in Pretoria. After his parents got divorced, he mostly lives his father in Pretoria. Musk became disaffect from his father, whom he himself describe his father as &#39;A TERRIBLE HUMAN BEING&#39;. At the age of 10, he developed and interest in <span style=\"color:#ff6842\"><u><strong>computing</strong></u></span> while using the Commodore VIC-20. Further, he learned computer programming using a manual &amp;, by age 12, sold the code of a basic based <span style=\"color:#ff6842\"><u><strong>videogame</strong></u></span> he created called <span style=\"color:#ff6842\"><u><strong>&#39;BLASTER TO PC</strong></u></span>&#39; and <span style=\"color:#ff6842\"><u><strong>office technology magazine</strong></u></span> for approximately $500. Musk, has attended Water kloof House Preparatory School &amp; Bryanston High School before graduating from Pretoria Boys High School.</p>', '2021-06-11 14:24:21'),
(6, 'Elon Musk', 'elonmusk.jpg', 'Business Career', 'bf591137e9d3dcda4a49b08d86be97ac.jpeg', '<p>His Business Career, started in 1995 with the web software company <span style=\"color:#ff6842\"><u><strong>Zip2</strong></u></span>, that he founded with Kimbal &amp; Greg Kouri. Compaq acquired Zip2 for $307 million in cash in February 1999. Musk received $22 million for his 7% share &amp; from there it gave boost to Elon&#39;s Business life. After that in 1991, Musk co-founded <span style=\"color:#ff6842\"><u><strong>X.com</strong></u></span>, an<span style=\"color:#ff6842\"><u><strong> online financial services</strong></u></span> &amp; <span style=\"color:#ff6842\"><u><strong>E-mail payment company</strong></u></span> which was later merged with a company called <span style=\"color:#ff6842\"><u><strong>Confinity</strong></u></span>, resulting to be known as <span style=\"color:#ff6842\"><u><strong>PayPal</strong></u></span> &amp; then one by one <span style=\"color:#ff6842\"><u><strong>SpaceX</strong></u></span>, <span style=\"color:#ff6842\"><u><strong>Tesla</strong></u></span>, SEC lawsuit, <span style=\"color:#ff6842\"><u><strong>Solar City</strong></u></span>, <span style=\"color:#ff6842\"><u><strong>Neuralink</strong></u></span>, <span style=\"color:#ff6842\"><u><strong>the Boring Company</strong></u></span>, <span style=\"color:#ff6842\"><u><strong>Starlink</strong></u></span> &amp; more got added in the list of his business career. He is the person who believes &amp; said,</p>\r\n\r\n<p><strong>&quot;Future is an option here. If things are not failing, you are not working enough.&quot;</strong></p>', '2021-06-11 14:24:24'),
(7, 'Elon Musk', 'elonmusk.jpg', 'SpaceX', '5f1402b1e2d4be4eb274fb6ce2e7bc24.jpeg', '<p><span style=\"color:#ff6842\"><u><strong>SpaceX</strong></u></span> is an American aerospace manufacturer &amp; space transportation services company head quartered in Howthorne, California. It&rsquo;s a privately owned company that continues to impress by launching unmanned [remotely controlled] <span style=\"color:#ff6842\"><u><strong>cargo vehicles</strong></u></span> to the international space station &amp; succeeding in doing so over &amp; over again, &amp; of course, the company was founded by non-other than <span style=\"color:#ff6842\"><u><strong>Elon Musk</strong></u></span>, an entrepreneur who has an eye for successful business. The main purpose of developing affordable <span style=\"color:#ff6842\"><u><strong>space vehicles</strong></u></span> &amp; <span style=\"color:#ff6842\"><u><strong>enabling Mars colonization</strong></u></span> in the future are one of Elon&rsquo;s long-term plans.</p>\r\n\r\n<p>SpaceX become one of the most talked about companies after launching a <span style=\"color:#ff6842\"><u><strong>TESLA ROADSTER</strong></u></span> in to space.</p>', '2021-06-11 14:24:26'),
(8, 'Elon Musk', 'elonmusk.jpg', 'Tesla', 'd8d2d0d687e253b73cc44df7196f1af0.jpeg', '<div class=\"accordion-collapse collapse show\" id=\"flush-collapseOne54\">\r\n<div class=\"accordion-body\">\r\n<div id=\"textdata1_54\"><span style=\"color:#ff6842\"><u><strong>TESLA</strong></u></span> is an American electric vehicle &amp; clean energy company based in Palo Alto, California. Tesla came up with an unfamiliar idea &amp; their revolutionary vision of turning automotive industry towards environment friendliness. At first, it was taken seriously but led by its visionary CEO Elon Musk, well enough with the introduction part.<br />\r\nElon Musk was not the <span style=\"color:#ff6842\"><u><strong>founder</strong></u></span> of Tesla but he wanted in, although Elon Musk is the mastermind who turned Tesla &amp; to be multibillion-dollar giant, it is today. He wasn&rsquo;t the only person behind the idea. Tesla was started by these guys Martin Eberhand &amp; Marc Tarpenning &amp; later Elon Musk, JB Straubel &amp; Lan Wright joined in. As mentioned, the founders somehow got bankrupt &amp; they were tackling a problem. Elon had a great interest so he joined the company in its early days because Elon didn&rsquo;t quite agree with the strategy of the at the time CEO of the company, he sort of pushed him out &amp; installed himself as CEO &amp; company&rsquo;s chief designer with his constant non-stopping innovation, extra-ordinary business ability &amp; as an attractive way of influence that he has, made him one of the most popular &amp; iconic figures of the 21st century. He managed to transform what was a small project into what is seen today as the most in car company in the world.</div>\r\n</div>\r\n</div>', '2021-06-11 14:24:31'),
(9, 'Elon Musk', 'elonmusk.jpg', 'Starlink', '098f56e439fd80fffd0389949173ba93.jpeg', '<p><span style=\"color:#ff6842\"><u><strong>Starlink</strong></u></span> is one of the main dream projects of Elon Musk. Starlink aim is to provide <span style=\"color:#ff6842\"><u><strong>internet</strong></u></span> around the globe, in every corner <span style=\"color:#ff6842\"><u><strong>without using fibre optics broadband cable</strong></u></span>, with use of Starlink satellites &amp; to provide high speed of internet. To achieve this, it wants to place 42,000 satellites, on the low orbit of the earth at a distance of 550km from it. SpaceX has asked the government to give permission for launching 42,000 satellites but the government has approved for only 1200 satellites.<br />\r\nOn 24 Jan, 2021, SpaceX has launched all together 143 satellites from their Rocket Falcon 9 on earth&rsquo;s orbit. SpaceX has fulfilled this 143 Satellites mission on a very low budget as they have used the reusable Falcon 9 Rocket.</p>', '2021-06-11 14:24:29'),
(10, 'Elon Musk', 'elonmusk.jpg', 'Starlink - Why it is a matter of concern for scientists and astronomers?', '36bae67b6b5bf2691ca12e906a648e9b.jpeg', '<p>As 9000 Satellites, are already present on the Orbit of earth, so if Starlink&rsquo;s project of positioning 42,000 Satellites goes successful, it will lead to two things,firstly, the space debris &amp; light pollution. So, this two are the biggest concerns of scientists &amp; astronomers. As SpaceX don&rsquo;t want, that there should come a problem in their way of fulfilling the aim of 42,000 Satellites, they have already come out for the solution, that is concerned by the scientists &amp; astronomers. The recently launched Satellite contains visors which is able, to not reflect the sun rays from the satellite. And to solve the problem of Space debris, they had made the satellites with those materials that once the time span completes of the particular satellite it will get crashed &amp; it&rsquo;s 90% of waste will fall on Earth.</p>', '2021-06-11 14:24:35'),
(11, 'Elon Musk', 'elonmusk.jpg', 'Starlink - How it works?', '9898a64352be6f008a6ff79fb9cef2b2.jpeg', '<p>Firstly, the signal from earth will go to <span style=\"color:#ff6842\"><u><strong>Starlink Satellite</strong></u></span>, then the satellite will communicate to other satellites &amp; then the best suited &amp; ideally located signal will be receive by the receiver.<br />\r\nTo work for providing high speed internet, this satellite will work with one another on the <span style=\"color:#ff6842\"><u><strong>laser beam technology</strong></u></span> &amp; this laser beam speed will be as same as the speed of light. This communication will take less then <span style=\"color:#ff6842\"><u><strong>micro second</strong></u></span> &amp; thus the user will taste a very high speed of internet.</p>', '2021-06-11 14:24:42'),
(12, 'Elon Musk', 'elonmusk.jpg', 'Starlink - A Boom!!', '784e471eeb72d78a5f0ac2bda5d67be5.jpeg', '<p>If <span style=\"color:#ff6842\"><u><strong>spaceX</strong></u></span> got successful in achieving their aim of <span style=\"color:#ff6842\"><u><strong>Starlink</strong></u></span> Project then the people who live in areas like dense forest or in remote villages, will too be able to surf on a <span style=\"color:#ff6842\"><u><strong>highspeed of internet</strong></u></span>. In the very start, the users will be benefitted by <span style=\"color:#ff6842\"><u><strong>150Mbps</strong></u></span> speed. It&rsquo;s biggest benefit, will be taken by the people living in areas where the telecom operators have failed to put the fiber optics broadband cables. It will be proved as a boon for each one of us.</p>', '2021-06-12 19:42:49'),
(13, 'Dogecoin', 'dogecoin.jpg', 'What is Dogecoin & How it works?', 'ca72278f6363d90d87d20ab45bf3df47.jpeg', '<p><span style=\"color:#ff6842\"><u><strong>Dogecoin</strong></u></span> is one of the strangest <span style=\"color:#ff6842\"><u><strong>crypto</strong></u></span> coins on the planet. It was started and launched in 2013, by two engineers Billy Marcus &amp; Jackson Palmer. Palmer featured the company logo &amp; selected the <span style=\"color:#ff6842\"><u><strong>Shiba Inu Dog</strong></u></span> picture, as it was a popular meme at that time. It was created for fun alternative to Bitcoin. But no one knew at that time this coin will come this far, and the whole market will revolve around it.</p>\r\n\r\n<p>How does Dogecoin work?</p>\r\n\r\n<p>Dogecoin is a <span style=\"color:#ff6842\"><u><strong>Cryptocurrency</strong></u></span> that runs on the <span style=\"color:#ff6842\"><u><strong>blockchain technology</strong></u></span>, similarly to <span style=\"color:#ff6842\"><u><strong>Bitcoin &amp; Ethereum</strong></u></span>. It&rsquo;s safe, sure &amp; made to used in a decentralized way.</p>', '2021-06-11 19:34:34'),
(14, 'Dogecoin', 'dogecoin.jpg', 'How it became popular?', '400ceea220006bbc327fddff348803ac.jpeg', '<p><span style=\"color:#ff6842\"><u><strong>Dogecoin</strong></u></span> became a viral sensation on internet, all of a sudden as it was not just a meme any more. The Dogecoin price continuously increased &amp; break all records of the price surge, as internet has served to be the number one source of Dogecoin publicity as <strong>&ldquo;it was a meme and memes never die.</strong>&rdquo; Also, the Reddit group has played a very important role in Dogecoins history. On Reddit, a group name SatoshiStreetBets continue engaged &amp; their dream is to make the value of <span style=\"color:#ff6842\"><u><strong>&lsquo;one Dogecoin&rsquo; a dollar</strong></u></span> which is currently valued in cents. The biggest role is played by <span style=\"color:#ff6842\"><u><strong>Elon Musk</strong></u></span> &amp; his <span style=\"color:#ff6842\"><u><strong>tweets</strong></u></span> about the Dogecoin, after which the value has kept increasing.</p>', '2021-06-11 19:26:55'),
(15, 'Dogecoin', 'dogecoin.jpg', 'How Dogecoin is linked to Elon Musk?', 'ce67b5b1fde2d12e08358063d80b46df.jpeg', '<p><span style=\"color:#ff6842\"><u><strong>Elon Musk</strong></u></span>, the CEO of TESLA is a supporter of Dogecoin. He is considered to be the top influencer who has sent <span style=\"color:#ff6842\"><u><strong>Dogecoin</strong></u></span> price to the sky or even on the moon by his tweets.<br />\r\nOnce even Musk has changed his Twitter bio to &lsquo;Former CEO of Dogecoin.&rsquo; Elon&rsquo;s tweet plays a very significant role in the matter of Dogecoin. He tweets on a daily basis about the Dogecoin.<br />\r\nOne of his tweets say,<br />\r\n<strong>&ldquo;SpaceX is going to put a Dogecoin on a literal moon.&rdquo;</strong><br />\r\nAnd the market value kept increasing.<br />\r\nBut recently Musk on the SNL show described Dogecoin as a <span style=\"color:#ff6842\"><u><strong>&lsquo;Hustle&rsquo;</strong></u></span>. He also said that it has a circulating supply of 117 billion coins, of which 113 billion have already been mined.<br />\r\nAlso, his recent tweet,<br />\r\n<strong>&ldquo;That Cryptocurrency is promising, but please invest with caution.&rdquo;</strong> Has made the value of <span style=\"color:#ff6842\"><u><strong>Dogecoin market fall</strong></u></span>. There is no doubt that Elon tweets are really powerful.<br />\r\nWell, the matter that we should invest in Dogecoin or not is depend on the social forums, so, catch the opportunity at right time by understanding when to enter &amp; when to exit.</p>', '2021-06-11 19:26:59'),
(16, 'Jeff Bezos', 'jeffbezos.jpg', 'Who is he?', '8a3e8ba2fc3abcda336af92869e3f2bd.jpeg', '<p>A famous Entrepreneur &amp; E-commerce evolver <span style=\"color:#ff6842\"><u><strong>Jeff Bezos</strong></u></span>, the Founder &amp; CEO of the company <span style=\"color:#ff6842\"><u><strong>Amazon</strong></u></span>, owner of The <span style=\"color:#ff6842\"><u><strong>Washington Post</strong></u></span> &amp; the one who introduce the Space Exploration Company <span style=\"color:#ff6842\"><u><strong>Blue Origin</strong></u></span>. His successful career has made him the richest person of the world with an estimated value of <span style=\"color:#ff6842\"><u><strong>$193 Billion</strong></u></span> by June 2021.</p>', '2021-06-11 15:16:56'),
(17, 'Jeff Bezos', 'jeffbezos.jpg', 'Early Life', '94cbc34bc3062ab96523201ec8478ed5.jpeg', '<p>When Jeff was 18 months old, his father divorced his mother. For 4 years, his mother raised him alone but soon she got married to Migual Bezos. From his childhood, Jeff was much interested in science, Tech &amp; was very much fond of reading books. When he was in 4th grade, there came a computer in his school, which the teachers even don&rsquo;t know how to operate but what Jeff operating a computer, at such a young age. At the age of 16, he started to work in Mc Donald&rsquo;s which was a good experience for him as he came to know about the customer services, how to work under pressure &amp; most importantly the Managerial Skills.</p>', '2021-06-11 15:16:59'),
(18, 'Jeff Bezos', 'jeffbezos.jpg', 'Business Career', '7eaed2399239df1159e4fd54ea697ccf.jpeg', '<p>His business career started in the year <span style=\"color:#ff6842\"><u><strong>1986</strong></u></span>,he was offered jobs at Intel, Bell Labs, and Andersen Consulting, &amp; many more. Firstly,he worked at Fitel where he was promoted to head of development and director of customer service thereafter. There he worked from 1988 to 1990. After that in 1990 he then joined D. E. Shaw &amp; Co, &amp; worked there until 1994, there he became the fourth senior vice-president at age 30. And then the time came when he realized that till when he will work for someone or under someone? And he got his answers once while net surfing. He got to know that the web users are growing by 2300% every year, as this was the era when the use of internet was growing rapidly.</p>\r\n\r\n<p>This was the opportunity waiting for him &amp; making the use of this opportunity he thought why not to start an online business as this was the Perfect time. And after working day &amp; night,finally he established his own Company <span style=\"color:#ff6842\"><u><strong>Amazon.com</strong></u></span> on 5th July,1994 in his house garage, which today has turned out to be the best <span style=\"color:#ff6842\"><u><strong>Online Shopping Platform</strong></u></span>. And after that,in Sep,2000 Bezos sounded <span style=\"color:#ff6842\"><u><strong>Blue Origin</strong></u></span>, a human spaceflight startup. Then on August 5, 2013, Bezos announced his purchase of The Washington Post for $250 million in cash,[106] at the suggestion of his friend, Don Graham. This is how his startup from a garage turned out to be a huge building of Amazon which made him today the worlds richest person.</p>', '2021-06-11 15:17:01'),
(19, 'Jeff Bezos', 'jeffbezos.jpg', 'Amazon.com', '79d4448fec3ffb2e7aea9a92097db9a6.jpeg', '<p><span style=\"color:#ff6842\"><u><strong>Amazon.com</strong></u></span> is a multi national technology company which focuses on <u><strong><span style=\"color:#ff6842\">e-commerce</span></strong></u>. From Google, Apple, Microsoft, Facebbok, Amazon too is one of the biggest five companies in U.S. Information Technology, industry. Also, it is the world&rsquo;s most valuable brand.<br />\r\n<span style=\"color:#ff6842\"><u><strong>Jeff Bezos</strong></u></span> was the founded <span style=\"color:#ff6842\"><u><strong>Amazon</strong></u></span> from his home&rsquo;s Motor Garage on July 5, 1994 with three computers &amp; few employees &amp; named the company as Cadbara.com which he later change the name to Amazon.com. It was started as an online market place for books but expanded to sell electronics, software, video games, furniture, food, toys, jewelry.</p>\r\n\r\n<p>In 2017, for US $13.4 billion Amazon acquired Whole Foods Market. In 2018,its two day delivery service,<span style=\"color:#ff6842\"> <u><strong>Amazon Prime</strong></u></span> surpassed 100 million subscribers worldwide.</p>\r\n\r\n<p>Amazon is known for its world&rsquo;s largest online market place &amp; cloud computing platform as measured by revenue in the world. It is also the largest internet company by revenue in the world.</p>\r\n\r\n<p>Also, in January 2021, Amazon invested with over $278 million by opening two new centres in Italy&rsquo;s, Novara &amp; Modena creating over 1100 jobs. Amazon really is regarded as one of the world&rsquo;s most valuable company.</p>', '2021-06-11 15:17:03'),
(20, 'Jeff Bezos', 'jeffbezos.jpg', 'Blue Origin', 'efa7c2acdbd7e815851b4d9b0905a991.jpeg', '<p>In 2000, <span style=\"color:#ff6842\"><u><strong>Jeff Bezos</strong></u></span> laid the foundation of <span style=\"color:#ff6842\"><u><strong>Blue Origin</strong></u></span>. Its an American privately funded aerospace manufacturer &amp; sub-orbital spaceflight services company in Kent, Washington. The vision of this company is to make <span style=\"color:#ff6842\"><u><strong>space travel cheaper</strong></u></span> &amp; more reliable through reusable launch vehicles. The company went public in 2003.<br />\r\nBlue Origin publicly announced their New Shepard will intend to fly uncrewed in 2011 &amp; crewed in 2012, but somehow their plans got <span style=\"color:#ff6842\"><u><strong>delayed</strong></u></span>.<br />\r\nOn 23rd Nov, Origin launched their sub-orbital flight New Shepard. The uncrewed vehicle went approximately 100km up from the earth&rsquo;s surface &amp; did a <span style=\"color:#ff6842\"><u><strong>successful vertical landing</strong></u></span>. This achievement created a storm in aerospace industry.<br />\r\nIn March 2016, Jeff discussed his plans to offer space tourism services to space. By Sep 2016, Blue announced that its orbital rocket would be named <span style=\"color:#ff6842\"><u><strong>&lsquo;New Glenn&rsquo;</strong></u></span> in the honor of the first American Astronaut, to orbit the earth. In May 2019, they announced the <span style=\"color:#ff6842\"><u><strong>&lsquo;Blue Moon Lander&rsquo;</strong></u></span> design concept, expected to fly on the New Glenn &amp; be ready to make a soft landing on Moon.<br />\r\nHowever, the company announced in March 2021 that the <span style=\"color:#ff6842\"><u><strong>New Glenn</strong></u></span> would not be launched until the fourth quarter of 2022, at the earliest.<br />\r\nThe space race will truly begin when New Glenn starts flying. It&rsquo;s already a new era for Blue Origin. Now, getting more <span style=\"color:#ff6842\"><u><strong>involved with NASA</strong></u></span> &amp; with money in the bank to expand &amp; develop the next generation of heavy-lift Orbital Rockets, Blue Origin is ready to go places !!</p>', '2021-06-11 15:17:05'),
(21, 'Sachin Tendulkar', '	sachin-tendulkar.jpeg', 'Tendlya to God of Cricket', 'ec7d18f27057ea0ebd0cbeebc1d725ba.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">There is no one who likes cricket but does not know <span style=\"color:#d35400\"><u><strong><span style=\"background-color:#ffffff\">Sachin Tendulkar</span></strong></u></span><span style=\"background-color:#ffffff\"><span style=\"color:#000000\">.</span> </span>He is one of the most popular cricketers not just in India but across the globe. </span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Sachin Tendulkar,<u> <strong><span style=\"color:#d35400\">the master blaste</span></strong>r,</u> is the name that continues to inspire many, not only in India but also all over the world to take up the sport. We know that in India<span style=\"color:#d35400\"> <strong><u>cricket is a religion</u></strong></span><strong><u> </u></strong>&amp; <strong><u><span style=\"color:#d35400\">Sachin Tendulkar is the god of the Cricket</span><span style=\"color:#000000\">.</span></u></strong></span></span></p>', '2021-06-13 09:51:54'),
(22, 'Sachin Tendulkar', '	sachin-tendulkar.jpeg', 'Early Life', 'b6871373f6bfa0127714a53fd5e6e394.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">As a young boy,<u> <strong><span style=\"color:#d35400\">Sachin</span> </strong></u>was considered<u> </u><strong><span style=\"color:#d35400\"><u>a bully</u></span>,</strong> &amp; often picked up fights with new<span style=\"color:#d35400\"> children&nbsp;<u><strong>in his school</strong></u>. To help, control his mysterious &amp; bullying tendencies, <u><strong>Ajit</strong>,</u> his elder brother<strong> </strong><strong><u>introduce</u></strong><u> </u>the young </span><u><span style=\"color:#d35400\"><strong>Sachin to cricket</strong></span></u> in 1984. His was introduced<span style=\"color:#d35400\"><strong> <u>to Ramakant Achrekar</u></strong></span>. After then Sachin was trained under Ramakant Archrekar during his school days. He shifted schools to be a part of the best teams in the cities. He then<u> <span style=\"color:#d35400\"><strong>attended</strong></span> </u>the<span style=\"color:#d35400\"> <u><strong>MRF Pace Foundation in Chennai</strong></u></span>. To train as a fast baller but <span style=\"color:#d35400\"><u><strong>on the advice of Dennis Lillee</strong></u></span>, an Australian outstanding fast baller of his generation, he <span style=\"color:#d35400\"><u><strong>left fast balling to concentrate on his batting abilities</strong></u></span>.</span></span></p>', '2021-06-14 06:23:41'),
(23, 'Sachin Tendulkar', '	sachin-tendulkar.jpeg', 'Career Life', 'bee428f9bdf53d1469263fc2267cdfae.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Sachin made his international debut at the <span style=\"color:#d35400\"><u><strong>age of 16</strong></u></span> in the year 1989 against ARCH Rivals Pakistan, scoring 15 runs before being bowled by Waqar Younis. In the 4<sup>th</sup> &amp; final test in Sialkot, he was<span style=\"color:#d35400\"><u><strong> hit on the nose by a bouncer bowled by Younus</strong></u></span>, but he <span style=\"color:#d35400\"><u><strong>declined medical assistance saying &ldquo;main khelega</strong></u></span>&rdquo; &amp; continued to bat even as he gushed blood from it, this was his spirit &amp; after that he kept playing many matches &amp; <span style=\"color:#d35400\"><strong><u>made super &ndash; duper records</u></strong></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><u>Sachin</u></strong> holds the <strong><u>records</u></strong> of <u><strong>playing most international matches</strong></u>. He has played a <u><strong>total of 664 international matche</strong></u>s, including a T20 international, 200 Tests &amp; 463 ODI&rsquo;s. He has also built a use number of runs. He has <span style=\"color:#d35400\"><u><strong>scored a total of 15 thousand 921 Runs in 200 Tests &amp; 18 thousand 426 Runs in 463 ODI&rsquo;s</strong></u></span>. Overall, Sachin has scored 34 thousand 347 Runs in the cricket world. He is the highest Run- scorer in both formats.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Sachin has <span style=\"color:#d35400\"><u><strong>won the man of the match title 76 times in 14 test</strong></u></span>s, 62 in ODI&rsquo;s. he had also scored a double century in the history of ODI&rsquo;s Cricket. In 2010, in Gwalior against South Africa, he made history by scoring an unbeaten 200 with the help of 25 fours &amp; 3 Sixes. He had a total of <span style=\"color:#d35400\"><u><strong>673 Runs at the 2003 World Cup</strong></u></span>. Not only this but he is the only batsman in the <span style=\"color:#d35400\"><u><strong>cricket world to score 100 centuries</strong></u></span>. No other batsman of Cricket is even closed to this record.</span></span></p>', '2021-06-14 06:23:44'),
(24, 'Sachin Tendulkar', '	sachin-tendulkar.jpeg', 'An inspiring Story of Sachin\'s life', 'cd61ae86758b89478ea16d8bade059f7.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">On the returning from the Australia tour, <span style=\"color:#d35400\"><u><strong>Sachin</strong></u></span><span style=\"color:#27ae60\"><u><strong> </strong></u></span>was <span style=\"color:#d35400\"><u><strong>with an Indian taxi driver</strong></u></span>, the driver was completely in service for him. As Sachin&rsquo;s <span style=\"color:#d35400\"><u><strong>stepped of the taxi</strong></u></span>, suddenly, it <span style=\"color:#d35400\"><strong><u>started raining</u></strong></span>, so the <span style=\"color:#d35400\"><strong><u>driver gave</u></strong></span> his<span style=\"color:#d35400\"><strong><u> jacket to Sachin</u></strong></span>, so he could cover himself up. So, <span style=\"color:#d35400\"><u><strong>Sachin was</strong></u></span> so <span style=\"color:#d35400\"><strong><u>inspired &amp; touched </u></strong></span>by the d<span style=\"color:#d35400\"><strong><u>river&rsquo;s decency</u></strong></span>, that he <span style=\"color:#e67e22\"><strong><u>himself </u></strong></span>went to the mart &amp; <span style=\"color:#d35400\"><strong><u>bought a new designer jacket for the driver</u></strong></span> and not only this he<span style=\"color:#d35400\"><strong><u> gave </u></strong></span>him <span style=\"color:#d35400\"><strong><u>his match t-shirt</u></strong></span> with <span style=\"color:#d35400\"><strong><u>his autograph</u></strong></span> also <span style=\"color:#d35400\"><strong><u>signed by other 10 members of the team</u></strong></span>. Also <span style=\"color:#d35400\"><strong><u>gave</u></strong></span> him the <span style=\"color:#d35400\"><strong><u>passes of the match</u></strong></span>. &nbsp;</span></span></p>', '2021-06-14 06:23:50'),
(25, 'Sachin Tendulkar', '	sachin-tendulkar.jpeg', 'Retirement', '6db4163c9bcdad0f918cd254595a0632.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">His <span style=\"color:#d35400\"><u><strong>24-year</strong></u></span> long marvelous <span style=\"color:#d35400\"><strong><u>Cricket career</u></strong></span> came to <span style=\"color:#d35400\"><strong><u>an end on 16<sup>th</sup> November 2013 </u></strong></span>when he a<span style=\"color:#d35400\"><strong><u>nnounced his retirement</u></strong></span>. In December 2012, he played his last ODI&rsquo;s match &amp; in 2013, 20-20 match. Let us tell you that his <span style=\"color:#d35400\"><strong><u>200<sup>th</sup> tests match</u></strong></span> against <span style=\"color:#d35400\"><strong><u>West Indies </u></strong></span>on 16<sup>th</sup> November 2013 was<span style=\"color:#d35400\"><strong><u> his adieu</u></strong></span> to the <span style=\"color:#d35400\"><strong><u>Cricketing world as a player</u></strong></span>.</span></span></p>', '2021-06-14 06:23:53'),
(26, 'Sachin Tendulkar', '	sachin-tendulkar.jpeg', 'Net Worth', '8d2ba95a1a3fe322d9bff94fffeb1863.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\">Sachin Tendulkar has a net worth <span style=\"color:#d35400\"><u><strong>$150 Million</strong></u></span> i.e., <span style=\"color:#d35400\"><strong><u>1090 crores in Indian Rupees</u></strong></span> by March 16<sup>th</sup>,2021. He&rsquo;s the world&rsquo;s <span style=\"color:#d35400\"><strong><u>richest cricket player</u></strong></span>. Sachin have been <span style=\"color:#d35400\"><u><strong>endorsed</strong></u></span> by the big <span style=\"color:#d35400\"><u><strong>brands</strong></u></span> like <span style=\"color:#d35400\"><u><strong>Pepsi, Adidas, TVS, MRF, Boost</strong></u></span> &amp; many more, this are his major sources of earning. Also, he&rsquo;s associated with the <span style=\"color:#d35400\"><u><strong>water purifier</strong></u></span> brand <span style=\"color:#d35400\"><strong><u>&lsquo;Livpure&rsquo;</u></strong></span> &amp; the <span style=\"color:#d35400\"><strong><u>electronic battery supplier &lsquo;Luminous.&rsquo;</u></strong></span> These brands have continuously renewed the ad deals with Tendulkar as their face. Sachin is a <span style=\"color:#d35400\"><strong><u>big lover of cars</u></strong></span>, &amp; many cars have been listed in his collection. He also owns a <span style=\"color:#d35400\"><u><strong>football team </strong></u></span>named <span style=\"color:#d35400\"><strong><u>Kochi ISL team </u></strong></span>in Indian Super League Football &amp; a team named<span style=\"color:#d35400\"><strong><u> Bengaluru </u></strong></span>in <span style=\"color:#d35400\"><strong><u>Premier Badminton League.</u></strong></span> Also, he owns two restaurants, one in <span style=\"color:#d35400\"><strong><u>Mumbai &amp; Bangalore</u></strong></span> named <span style=\"color:#d35400\"><strong><u>Tendulkar&rsquo;s &amp; Sachin&rsquo;s respectively</u></strong></span>.</span></span></span></p>', '2021-06-14 06:24:43'),
(27, 'MS Dhoni', '61EDsbFxWPL._SL1280_.jpg', 'Our Mahi', '0ff07b39f355a5f1b9fb6fa016e881f5.jpeg', '<p><span style=\"font-size:1.2rem\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#d35400\"><u><strong>Mahi </strong></u></span>aka Mahindra Singh Dhoni has made India proud. To make<span style=\"color:#d35400\"><u><strong> India </strong></u></span>one of the most outstanding <span style=\"color:#d35400\"><u><strong>champions of cricket</strong></u></span>, his contribution is extra ordinary. A simple <span style=\"color:#d35400\"><u><strong>boy from Jharkhand</strong></u></span> got the chance to<span style=\"color:#d35400\"><u><strong> captain India&rsquo;s cricket team</strong></u></span>, the most terrific team in the <span style=\"color:#d35400\"><u><strong>world</strong></u></span>. His life was a package of struggle hard work, love, breakdown, success etc., almost everything. And here he stands as the<span style=\"color:#d35400\"><u><strong> best captain</strong></u></span>, the <span style=\"color:#d35400\"><u><strong>country </strong></u></span>has ever seen.</span></span></p>', '2021-06-14 16:13:14'),
(28, 'MS Dhoni', '61EDsbFxWPL._SL1280_.jpg', 'Early Life', '07c06347a6654204a2d237995c7225eb.jpeg', '<p><span style=\"font-size:1.2rem\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#d35400\"><u><strong>MS Dhoni</strong></u></span> was much<span style=\"color:#d35400\"><u><strong> </strong></u></span><span style=\"color:#000000\">interested</span><span style=\"color:#d35400\"><u><strong> </strong></u></span>in<strong><u>&nbsp;</u></strong><span style=\"color:#000000\">Badminton &amp;Football</span>; it was <span style=\"color:#d35400\"><strong><u>not cricketing</u></strong></span> that MS Dhoni <span style=\"color:#d35400\"><u><strong>turned to</strong></u></span>. He was the <span style=\"color:#d35400\"><u><strong>goalkeeper </strong></u></span>of his <span style=\"color:#000000\">school<strong> </strong>football team</span>. The <span style=\"color:#000000\">turning point</span><span style=\"color:#d35400\"><strong><u> </u></strong></span>in his life <span style=\"color:#000000\">came</span> when one day, to <span style=\"color:#000000\">fill </span>in for the<span style=\"color:#d35400\"> <u><strong>wicket keeper</strong></u></span> of the <span style=\"color:#000000\">cricket team</span>, the <span style=\"color:#000000\">coach sent</span> him <span style=\"color:#000000\">as a replacement. After </span>that <span style=\"color:#d35400\"><strong><u>Dhoni adapted cricket &amp; cricket adapted Dhoni</u></strong></span>. His <span style=\"color:#000000\">performance</span><span style=\"color:#d35400\"><u><strong> </strong></u></span>was<span style=\"color:#d35400\"><u><strong> </strong></u></span><span style=\"color:#000000\">impressive </span>as a wicket keeper as well<u><strong> </strong></u><span style=\"color:#000000\">as a batsman </span>which booked his<span style=\"color:#000000\"><u><strong> </strong></u></span><span style=\"color:#000000\">slot</span><span style=\"color:#d35400\"><u><strong> </strong></u></span>in the<span style=\"color:#d35400\"><u><strong> Commando Cricket Club team</strong></u></span>. He then continued climbing the ladders. Of success. As the time passed, he joined Indian railways as a <span style=\"color:#d35400\"><u><strong>TTE in Midnapore district</strong></u></span>, West Bengal in 2000. Despite continue in the job, he worked hard in on the cricket fields&nbsp;because he was <span style=\"color:#d35400\"><strong><u>destined for something far bigger</u></strong></span>.</span></span></p>', '2021-06-14 16:05:21'),
(31, 'MS Dhoni', '61EDsbFxWPL._SL1280_.jpg', 'Career Life', 'c1004b77d141ab46ab5e259690bae86a.jpeg', '<p><span style=\"font-size:1.2rem\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#d35400\"><u><strong>Dhoni</strong></u></span> making a mark in the India A squad he was picked in the <span style=\"color:#d35400\"><u><strong>ODI squad</strong></u></span> for the Bangladesh tour in 2004/05. He didn&rsquo;t have a great start. In spite of an average series against Bangladesh, Dhoni was given <span style=\"color:#d35400\"><u><strong>another chance </strong></u></span>&amp; was picked for the <span style=\"color:#d35400\"><u><strong>Pakistan ODI</strong></u></span> series. And then played on. He <span style=\"color:#d35400\"><u><strong>Captained </strong></u></span>the Indian national team in limited overs formats from 2007 to 2017 &amp; in test cricket from 2008 to 2014. Under his captaincy, India <u><strong><span style=\"color:#d35400\">won</span> </strong></u>the inaugural <span style=\"color:#d35400\"><u>2007 ICC World twenty20</u></span>, the 2010 &amp; 2016 Asia Cup, the <span style=\"color:#d35400\"><u><strong>2011 ICC Cricket World Cup</strong></u></span> &amp; 2013 ICC Champions Trophy. Also, he is one of the highest run scorers in ODI&rsquo;s &amp; is considered as <span style=\"color:#d35400\"><u><strong>an effective finisher</strong></u></span> in limited overs formats. Also, he holds the records of playing most international matches as a captain.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-14 16:05:05'),
(32, 'MS Dhoni', '61EDsbFxWPL._SL1280_.jpg', 'Business Career', '464a801c8cb56aa766b789207f0e6843.jpeg', '<p><span style=\"font-size:1.2rem\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#d35400\"><u><strong>MS Dhoni</strong></u></span> also has a hand in<span style=\"color:#d35400\"><u><strong> business.</strong></u></span> In Feb 2016, he launched his brand<span style=\"color:#d35400\"><strong><u> SEVEN</u></strong></span>. He owns the footwear of the brand is the <span style=\"color:#d35400\"><u><strong>brand ambassador</strong></u></span> of his company. Also in 2011, MS Dhoni was conferred on <span style=\"color:#d35400\"><u><strong>honorary rank of lieutenant-colonel </strong></u></span>in the<span style=\"color:#d35400\"><u><strong> Indian Territorial Army </strong></u></span>for his contribution in Cricket.</span></span></p>', '2021-06-14 16:04:44'),
(33, 'MS Dhoni', '61EDsbFxWPL._SL1280_.jpg', 'Personal Life', 'e52e498ae51e1f21fa8672f9b71048b7.jpeg', '<p><span style=\"font-size:1.2rem\"><span style=\"font-family:Calibri,sans-serif\">Before marrying his schoolmate Sakshi Singh Rawat, he <span style=\"color:#d35400\"><u><strong>used to love Priyanka Jha</strong></u></span>, whom he met in his early 20&rsquo;s. in 2002, his girlfriend Priyanka <span style=\"color:#d35400\"><u><strong>died in a car accident</strong></u></span>. He got so disturb, that it almost took a year to be him again &amp; was <span style=\"color:#d35400\"><u><strong>back with a BANG!!</strong></u></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">On July 4, 2010, <span style=\"color:#d35400\"><u><strong>Sakshi &amp; Dhoni got married</strong></u></span> &amp; own 6<sup>th</sup> Feb 2015, the couple gave birth to a<span style=\"color:#d35400\"><u><strong> baby girl named Ziva</strong></u></span>.</span></span></p>', '2021-06-14 16:04:21'),
(34, 'MS Dhoni', '61EDsbFxWPL._SL1280_.jpg', 'Retirement', '7d02a5a6548ab77adc5bcbe5ec3425af.jpeg', '<p><span style=\"font-size:1.2rem\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#d35400\"><u><strong>Mahi</strong></u></span> announced his <span style=\"color:#d35400\"><u><strong>retirement</strong></u></span> from international cricket on <span style=\"color:#d35400\"><u><strong>15 August 2020</strong></u></span> on the day of India&rsquo;s 74<sup>th</sup> Independence. He did so by <span style=\"color:#d35400\"><strong><u>posting a video on Instagram </u></strong></span>that contained pictures from both the best &amp; the worst moments of his career, &amp; has been captioned as &ldquo;thanks a lot for your love &amp; support throughout from 1929 hrs consider me <span style=\"color:#d35400\"><u><strong>as retired</strong></u></span>.</span></span></p>', '2021-06-14 16:03:25'),
(36, 'MS Dhoni', '61EDsbFxWPL._SL1280_.jpg', 'Net Worth', 'd0bb30fee77524fe3f21167c28aa19c4.jpeg', '<p><span style=\"font-size:1.2rem\"><u><strong><span style=\"color:#d35400\">Dhoni</span>&nbsp;</strong></u>has a<span style=\"color:#d35400\">&nbsp;<u><strong>net worth&nbsp;</strong></u></span>of&nbsp;<span style=\"color:#d35400\"><u><strong>$110 million</strong></u></span>&nbsp;as of 2021, which makes him one of the<u><strong>&nbsp;<span style=\"color:#d35400\">richest cricketers</span></strong></u>&nbsp;in the world. Half of his revenue comes from brand endorsement. In 2021, Dhoni net worth in&nbsp;<span style=\"color:#d35400\"><u><strong>Indian rupees</strong></u></span>&nbsp;is it&nbsp;<span style=\"color:#d35400\"><u><strong>826 Crores</strong></u></span></span>.</p>', '2021-06-14 16:06:17'),
(38, 'Virat Kohli', 'untitled-3.jpg', 'The Master of the Run Chase', 'c9653c113e9544a9c138bbc971b124e4.jpeg', '<p><span style=\"color:#d35400\"><u><strong>Virat Kohli</strong></u>&nbsp;</span>who doesn&rsquo;t know him. He is the legendary player of the Indian Cricket Team. After Sachin Tendulkar &amp; MS Dhoni. He is called the&nbsp;<span style=\"color:#d35400\"><u><strong>backbone&nbsp;</strong></u></span>of&nbsp;<span style=\"color:#d35400\"><u><strong>Indian Cricket&nbsp;</strong></u></span>because he is a right-handed in International Cricketer &amp; one of the&nbsp;<span style=\"color:#d35400\"><u><strong>most talented&nbsp;</strong></u></span>&amp; promising cricketers. We have seen his growing maturity, his consistency &amp; his&nbsp;<span style=\"color:#d35400\"><u><strong>leadership abilities</strong></u></span>. He is the&nbsp;<span style=\"color:#d35400\"><u><strong>Captain</strong></u>&nbsp;</span>of Indian national cricket team-ODI &amp; Test. Virat Kohli is an inspiration &amp; role model for the youth today. Virat was very much inspired by<u><strong>&nbsp;<span style=\"color:#d35400\">Sachin Tendulkar</span></strong></u>. He is very supporting of young players. He is a very talented player.</p>', '2021-06-14 18:41:42');
INSERT INTO `knowledges` (`knowledgesrno`, `maintopic`, `maintopicphoto`, `topicheading`, `topicphoto`, `topicdetails`, `written_at`) VALUES
(39, 'Virat Kohli', 'untitled-3.jpg', 'Early Life', '3d406c3280e3a5c5877727560812dc12.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\"><span style=\"color:#d35400\"><u><strong>Kohli</strong></u></span> had a great interest in Cricket from the very initial stage of his life. According to his family when he was<span style=\"color:#d35400\"><u><strong> three years old</strong></u></span>, Kohli would pick up a cricket<span style=\"color:#d35400\"><u><strong> bat</strong></u></span>, <span style=\"color:#d35400\"><u><strong>start swinging it</strong></u></span> &amp; also his father to bowl at him. As Virat was fond of cricket, his neighbors suggested his father that &ldquo;Viral shouldn&rsquo;t waste his time in <span style=\"color:#d35400\"><u><strong>Gully Cricket </strong></u></span>rather than he should join a <span style=\"color:#d35400\"><u><strong>professional Club</strong></u></span>.&rdquo; And after that he was trained under <span style=\"color:#d35400\"><u><strong>Rajkumar Sharma</strong></u></span>. </span></span></span></p>', '2021-06-14 18:41:47'),
(40, 'Virat Kohli', 'untitled-3.jpg', 'Career/Achievement', 'aeee8e1db3fd3c07f8acd0631d60176f.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\">The <span style=\"color:#d35400\"><u><strong>West Delhi Cricket Academy </strong></u></span>was created in 1998 &amp; Kohli was part of its first intake. Kohli first came into the <span style=\"color:#d35400\"><u><strong>spotlight </strong></u></span>when he played for Delhi in a <span style=\"color:#d35400\"><u><strong>Ranji Trophi Match </strong></u></span>against Karnataka on the day of his <span style=\"color:#d35400\"><u><strong>father&rsquo;s death</strong></u></span>. Choosing to stay &amp; bat, he went on to score 90 runs. That is an act of great commitment to the team &amp; his innings turned out to be crucial. Kohli made his ODI debut in 2008 &amp; was part of the Indian team which won the <span style=\"color:#d35400\"><u><strong>2011 World Cup. </strong></u></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:13.0pt\">Kohli played for <span style=\"color:#d35400\"><u><strong>Royal Challengers Bangalore</strong></u></span> at the 2008 <span style=\"color:#d35400\"><u><strong>Indian Premier League</strong></u></span> (IPL). He was bought for $30,000 before the first season in scored 165 runs in 13 innings at an average of 15 &amp; took two wickets with his balls. He continued his IPL career from 2008 to 2013. He was named the <span style=\"color:#e67e22\"><u><strong>Captain of the RCB</strong></u></span> Team for the 6<sup>th</sup> Season. He holds the fastest century (in 52 balls) by an Indian Batsman in ODI&rsquo;s against Australia in Jaipur. He is the fastest Cricketer to reach <span style=\"color:#e67e22\"><u><strong>6000 runs in ODI&rsquo;s</strong></u></span>, Bettering Legendary West Indian Vivian Richard&rsquo;s records. He is also the fastest cricketers to reach<span style=\"color:#e67e22\"><u><strong> 20 centuries in ODI&rsquo;s</strong></u></span>. He has made most ODI runs by an Indian cricketer with a consistency. Of four years from 2010-2013. Also holds a record of first test Captain in cricket history to score <span style=\"color:#d35400\"><u><strong>3 centuries</strong></u></span> in first three innings. </span></span></span></p>', '2021-06-14 18:41:50'),
(42, 'Virat Kohli', 'untitled-3.jpg', 'Business Career & Net Worth', 'ce209b7dd433e768da426af0564fcd59.jpeg', '<p><span style=\"color:#d35400\"><u><strong>Kohli&nbsp;</strong></u></span>has made sure that his<span style=\"color:#d35400\"><u>&nbsp;<strong>retirement plans</strong></u></span>&nbsp;are well intact. You will be surprise to know that a large part of Virat massive income, which put him on&nbsp;<u><strong><span style=\"color:#d35400\">Forbes Globa</span>l</strong></u>&nbsp;list of highest paid athletes in the world, comes from his well-thought-out investment. Here&rsquo;s take a look at some of the famous&nbsp;<span style=\"color:#d35400\"><u><strong>brand</strong></u>&nbsp;</span>owned by Virat Kohli.</p>\r\n\r\n<ol>\r\n	<li><span style=\"color:#d35400\"><strong>Wrongn</strong></span>-stylish looks &amp; unique fashion sense.</li>\r\n	<li><span style=\"color:#d35400\"><strong>Chisel Gyms</strong></span></li>\r\n	<li><span style=\"color:#d35400\"><strong>Vueva</strong></span>-a luxurious &amp; fine dining place.</li>\r\n	<li><span style=\"color:#d35400\"><strong>FC Goa</strong></span>- a football team (ISL).</li>\r\n	<li><span style=\"color:#d35400\"><strong>Sport Convo</strong></span>- a platform that allows the sports fans to talk about their favorite game &amp; players.</li>\r\n	<li><span style=\"color:#d35400\"><strong>UAE Royals</strong></span>- A tennis team based in Dubai (IPIL).</li>\r\n	<li><span style=\"color:#d35400\"><strong>Bengaluru Yodhas</strong></span>- Pro wrestling league.</li>\r\n	<li><span style=\"color:#d35400\"><strong>Stepathlon Kids</strong></span>- for the age of group of 8-12 years to adopt a healthy lifestyle.</li>\r\n	<li><span style=\"color:#d35400\"><strong>One8 x Puma</strong></span>- Produces luxury footwear.</li>\r\n	<li><strong><span style=\"color:#d35400\">One8 x Commune</span>&nbsp;</strong>- One8 commune is the master franchise of One8&rsquo;s restaurant chain.</li>\r\n</ol>\r\n\r\n<p>Till date, because office business career apart from cricket, his total&nbsp;<span style=\"color:#d35400\"><u><strong>net worth&nbsp;</strong></u></span>is<span style=\"color:#d35400\"><u><strong>&nbsp;$130 million</strong></u></span>&nbsp;that is&nbsp;<span style=\"color:#d35400\"><u><strong>980 crores</strong></u></span>&nbsp;in<strong><span style=\"color:#d35400\"><u>&nbsp;Indian rupees</u></span>.</strong></p>', '2021-06-14 18:41:57'),
(44, 'Virat Kohli', 'untitled-3.jpg', 'Personal Life', '17b866b2b6833d6ed600f254edede736.jpeg', '<p><span style=\"color:#d35400\"><strong><u>Viral Kohli&nbsp;</u></strong></span>was&nbsp;in a high-profile relationship with Bollywood Actress&nbsp;<span style=\"color:#d35400\"><strong><u>Anushka Sharma</u></strong></span>. But they broke up early in 2016. Later on, they patched up &amp; the two tied the knot at<span style=\"color:#d35400\">&nbsp;<u><strong>Borgo Finocchieto in Tuscany Italy</strong></u></span>&nbsp;on December 11, 2017. And now they are blessed with a&nbsp;<span style=\"color:#d35400\"><u><strong>baby girl name Vamita</strong></u></span><span style=\"color:#000000\"><strong>.</strong></span></p>', '2021-06-14 18:42:00'),
(45, 'Mithali Raj', 'mithali-Raj.jpg', 'The Lady Tendulkar', 'cf228b91a081f4db4f2b172f6461d3ee.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#d35400\"><strong><u>Mithali Raj </u></strong></span>is a famous Indian <span style=\"color:#d35400\"><u><strong>female cricketer</strong></u></span>, also the captain of Indian Women&rsquo;s national team. She is a shining star of Indian&rsquo;s Women cricket due to her outstanding &amp; remarkable batting &amp;<span style=\"color:#d35400\"><u><strong>captainship</strong></u></span> skills.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">You will be shock to know that cricket was not Raj&rsquo;s first choice as she<span style=\"color:#d35400\"><u><strong> loved to Dance</strong></u></span>, wanted to became a Bharatanatyamdancer but she chose cricket over dance.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">At a young age of 19, she came intothe eyes of the world. She is the <span style=\"color:#d35400\"><u><strong>youngest female cricketer</strong></u></span> to score a century in her first ODI. She became the Captain of the<span style=\"color:#d35400\"><strong><u> Indian Women Cricket</u></strong></span> team in the year 2004. Raj had secured no.1 position in the list of players of the 2013 World Cup. Raj has played 10 WTests &amp; 214 WODI &amp; scored 663 &amp; 7098 runs respectively. Also, she led the Indian team to the finals in the <span style=\"color:#d35400\"><u><strong>2005 World Cup</strong></u></span> where the team<span style=\"color:#d35400\"><u><strong> lost to Australia</strong></u></span>. In 2017, she became the first player to score 6000 runs in WODI&rsquo;s. In September, 2019, Mithali retired from T201 cricket as she dreams to bring the <span style=\"color:#d35400\"><u><strong>World Cup to her country by 2021</strong></u></span> as she wants to focus her energies for the 2021 One day World Cup.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Raj has a net worth of <span style=\"color:#d35400\"><u><strong>$5 million in 2021</strong></u></span>, she lives a luxurious life style. Her primary income comes from cricket &amp; secondary income comes from brands TV ads, shows.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">She has proved, that girls can achieve anything with hardwork &amp; patience. She is also termed as<span style=\"color:#d35400\"><u><strong> woman Sachin Tendulkar </strong></u></span>as her record speaks for herself.</span></span></p>', '2021-06-19 16:12:42'),
(46, 'Jhulan Goswami', 'profile_4_20181015.jpg', 'The Ball Girl', '71a485e5f9c3f58db836fc6619c8d3bb.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#d35400\"><u><strong>Jhulan Goswami</strong></u></span> is an Indian national cricketer, an all-rounder. She is regarded as one of the greatest <span style=\"color:#d35400\"><u><strong>woman fast bowler</strong></u></span> of all time &amp; one of the fastest bowlers in the history of Womens Cricket.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Initially, Jhulan was a fan of football but by the age of 15, she got much interested in Cricket. The family of Jhulan didn&rsquo;t support her but agree when Jhulan&rsquo;s coach <span style=\"color:#d35400\"><u><strong>Swapan Sadhu </strong></u></span>made them understood that Jhulan has a talent. Jhulan once told that her coach on seeing her talent said that,&ldquo;<span style=\"color:#8e44ad\"><strong><u>you keep focus on bowling &amp; forget other things like batting</u></strong></span>&rdquo;.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Also, Jhulan had to travel long distance as there were no coaching centre near her, her father or mother used to travel with her because she was afraid of travelling alone but soon, she became fearless and started travelling on her own &amp; after that she never looked back.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">At the age of 19, she made her first debut in 2002 in an <span style=\"color:#d35400\"><u><strong>ODI against England</strong></u></span>. She won the 2007 ICC Women&rsquo;sPlayer of the year Award. Goswami is the highest wicket taker in Women&rsquo;s ODI cricket. Later in 2008 she took over the <span style=\"color:#d35400\"><u><strong>captaincy </strong></u></span>from Mithali Raj &amp; held<span style=\"color:#d35400\"><strong><u> till 2011</u></strong></span>. In 2021, she was named India&rsquo;s test squad for their one &ndash; off match against the England women&rsquo;s cricket team. In Sep, 2018, against South Africa she became the first bowler to take<span style=\"color:#d35400\"><strong><u> 300 wickets</u></strong></span> in WODI&rsquo;s.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">Her net worth as per 2020 is <span style=\"color:#d35400\"><u><strong>7.3 Crore </strong></u></span>i.e., &amp; $1 million. Her net worth compromises of the income she receives from the <span style=\"color:#d35400\"><u><strong>Board of Control for Cricket in India</strong></u></span> (BCCI). Goswami was placed in grade B by BCCI in their Central Contract list. As per the contract she earns 30 lakh per annum</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">To play cricket an achieve something is a dream of almost every child but what matters is to get out of those struggles &amp; for girls, it becomes more difficult but <span style=\"color:#d35400\"><strong><u>Jhulan Goswami is someone who nailed it!</u></strong></span></span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-19 16:13:59'),
(47, 'ISRO', 'ISRO.jpg', 'History of ISRO', '9a3d847c151cb0d8c4d68ee7c483b7a7.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">ISRO is <span style=\"color:#ff6842\"><u>India&rsquo;s pride</u></span>. Every achievement of ISRO is the headlines of T.V &amp; newspapers. Whom every Indian is proud of, that is ISRO. ISRO has created an history in world, in space research. ISRO has shaken the world from its achievements.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">So, let us dig in the history of ISRO</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1962, <span style=\"color:#ff6842\"><u>Vikram Sarabhai </u></span>recognized the need in space research. Jawaharlal Nehru under the department of atomic energy, established THE INDIAN NATIONAL COMMITTEE OF SPACE RESEARCH (INCOSPAR) on the urge of Scientist Vikram Sarabhai. Later on, INCOSPAR grew &amp; became ISRO in 1969 with DAE.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">On <span style=\"color:#ff6842\"><u>21<sup>st</sup> Nov,1963</u></span>, from Thumba, first rocket was fired as the aim was only to reach the upper atmosphere of Space. Also, the parts of the rocket were carried on cycle. And then one by one achievements took place.</span></span></p>', '2021-06-19 10:32:31'),
(48, 'ISRO', 'ISRO.jpg', 'Aryabhata', '7f62d160016173d7d8450be3a4827766.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">On <span style=\"color:#ff6842\"><u>19<sup>th</sup> August,1975</u></span> Aryabhata Satellite was launched. It was made in India but was launched with the help of Soveit Union, as at that time India was not capable of sending rockets with payload.</span></span></p>', '2021-06-19 10:32:34'),
(49, 'ISRO', 'ISRO.jpg', 'Rocket SLV 3 & Rohini', '70a001b2ad0a5a08c99c1b84a577edc7.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">ISRO created its fist rocket SLV 3 which can carry payload &amp; ROHINI named Satellite was launches on 18<sup>th</sup> July,1980. It was an experimental satellite to study the electromagnetic clearance, waves &amp; what else is there in space. And thus, India became 6<sup>th</sup> country who could launched its own rocket with payload in 1980.</span></span></p>', '2021-06-19 10:32:37'),
(50, 'ISRO', 'ISRO.jpg', 'Apple', '59c9f165331ea8cc56136925c38dcd28.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1981, Apple Satellite was launched, it too was an experimental satellite. And yeah, it&rsquo;s true that this satellite was carried by a<span style=\"color:#ff6842\"><u> bullock cart</u></span> to its launch center.</span></span></p>', '2021-06-19 10:32:39'),
(51, 'ISRO', 'ISRO.jpg', 'Rakesh Sharma', '4e30c21f1ad03e3a24ac80bafd00bd48.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1984, Rakesh Sharma, became the first citizen of India, who went to space when he flew abroad the Soveit Rocket Soyuz-T-11. He spent almost 8 days in the Salyut 7, a Russian Orbital Station.</span></span></p>', '2021-06-19 10:32:41'),
(52, 'ISRO', 'ISRO.jpg', 'Polar Satellite Launch Vehicle (PSLV)', 'bfb1e38f6193aa29e8585c5c3af5fdf3.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1997, PSLV was introduced. Today&rsquo;s PSLV are a little bit modified as per the need. And in 1999, with the help of PSLV, <span style=\"color:#ff6842\"><u>three satellites including India, German &amp; Korean were launched altogether at a time</u></span>, it was a huge achievement.</span></span></p>', '2021-06-19 10:32:46'),
(53, 'ISRO', 'ISRO.jpg', 'Geosynchronous Satellite Launch Vehicle (GSLV)', '030aec0e519dc2956d36570cbd2fe085.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 2001, GSLV was introduced, it&rsquo;s a three-stage heavy lift launch vehicle developed by ISRO.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Space Capsule Recovery Experiment (SRE-1)</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Inn 2007, SRE-1 was taken place. It was an <span style=\"color:#ff6842\"><u>experimental spacecraft</u></span>. After 12 days it re-enters the Earth&rsquo;s atmosphere splashing down into the Bay of Bengal.</span></span></p>', '2021-06-19 10:32:51'),
(54, 'ISRO', 'ISRO.jpg', 'Chandrayaan  1', '9c2ce4c06c60a20a79f8accd78a43894.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 2008, Chandrayaan was launched. It landed successfully on moon&rsquo;s surface. And<span style=\"color:#ff6842\"><u> India became the 1<sup>st</sup> country</u></span> to find out the evidence of water on moon&rsquo;s surface just because of Chandrayaan-1.</span></span></p>', '2021-06-19 10:32:55'),
(55, 'ISRO', 'ISRO.jpg', 'Mars Orbital Mission (MOM)', 'b02bc05b3c325dee59bf9d41a52bcedb.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 2013, MOM also known as Mangalyaan Mission was launched. <span style=\"color:#ff6842\"><u>MOM was India&rsquo;s first interplanetary mission.</u></span> From then till now, data has been streaming through there till here for further research &amp; to study about the Environment of Mars. &nbsp;</span></span></p>', '2021-06-19 10:32:58'),
(56, 'ISRO', 'ISRO.jpg', 'Chandrayaan-2', 'cf7f97ed3c61c4ab4373505fe0d7510a.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Spacecraft was launched on 22<sup>nd</sup> July,2019 by a GSLV Mark III MI. However, the lander was not able to do a soft landing &amp; the connection got lost. The ISRO Chairman K.Sivan, stated that &ldquo;it must be a hard landing&rdquo;, the Failure Analysis Committee concluded that it was caused by a Software Glitch. ISRO may re-attempt a landing in 2022 with Chandrayaan 3.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-19 10:33:00'),
(57, 'Stock market', 'stockmarket.jpeg', 'What is Stock market?', 'd464eb9e0a5fed5e66ec3c0e25df9f6a.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Stock Market, share market or Equity market all three means the same thing. This is a market where you can buy &amp; sell shares. Buying the shares means that you are buying some percentage of ownership in a company. That is, you are becoming the owner of the company for some percent. If that company will make profit, then you will also get some percent of that profit &amp; if it suffers a loss, then you will also have to bear some percent of loss.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Let me give you an example on a smallest scale:</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Suppose if you want to open a new startup. You&rsquo;re having an amount of Rs.15000 with you but that&rsquo;s not enough. So, you approached a friend of yours &amp; tell him to invest another Rs.15000 &amp; offer him a 50-50 partnership. So, in future if company makes a profit, then 50% will be yours &amp; 50% of it would be of your friend&rsquo;s &amp; vice versa. Thus, in this case, you gave 50% of shares to your friend in this company.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;The same thing takes place in Stock Market but on a big scale. The only difference is you don&rsquo;t go to your friend instead you go to the entire world &amp; invite them to buy shares in your company.</span></span></p>', '2021-06-19 17:11:28'),
(58, 'Stock market', 'stockmarket.jpeg', 'What is Stock Exchange?', '36f9bf13e6478fa956e2c3451828776d.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Stock Exchange is that place, that building where people buy &amp; sell shares of the company. It can be divided into two types of market i.e, <span style=\"color:#ff6842\"><u>Primary Market &amp; Secondary Market.</u></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Primary Market is the market where the companies sell their shares. It is totally the decision of the company to decide the price of their shares. However, there are regulations too. A company cannot manoeuvre too much because it is obviously dependent on demand as how much price people are ready to pay for the company&rsquo;s share.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">If a company has a value of one lakh. It distributes one lakh of its share &amp; offers it to the people in one rupee per share. Now if its demand is high, people will be like &ldquo;I should also buy shares, I may also buy shares, then surely the company will be able to sell their shares at a higher price.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Nowadays what do companies do is, they decide upon a range. There&rsquo;s a minimum price &amp; a maximum price &amp; they decide to sell their shares within that range.</span></span></p>', '2021-06-19 17:11:48'),
(59, 'Stock market', 'stockmarket.jpeg', 'Indias Stock Exchange', 'eaf767fc4bccdda15ab822a2c581ab57.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Every country has its own stock exchange. In India, there are two popular stock exchanges. The first one is Bombay Stock Exchange in which almost <span style=\"color:#ff6842\"><u>5400 companies have been registered</u></span>. And the second one is National Stock Exchange under which 1700 companies are registered.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">As there are so many companies that&rsquo;ve been registered under these two stock exchanges. So if one wants to observe the overall prices of the shares of the companies are whether moving up or down.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">So, how can one view this?</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">This problem is solved as there are measurements called NIFTY &amp; SENSEX which helps us to measure for the same.</span></span></p>', '2021-06-19 17:11:30'),
(60, 'Stock market', 'stockmarket.jpeg', 'What is SENSEX?', 'c4abddc83cc2381c421c57d4c90ffa9a.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">SENSEX stands for Sensitivity Index, that display us the average top trending stocks or the average outing of the top <span style=\"color:#ff6842\"><u>30 financially sound &amp; very well-established organizations listed on BSE</u></span>. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In simple terms, SENSEX is an Index &amp; an Index is basically an indicator which gives you a general idea whether the stocks of the top 30 companies listed on BSE have gone up or most of the stocks have gone down. SENSEX is an indicator of all the prices of the major companies of the BSE. </span></span></p>', '2021-06-19 17:11:33'),
(61, 'Stock market', 'stockmarket.jpeg', 'What is NIFTY?', '02e0b57de0b11594dce072684d727a8e.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">NIFTY stands for National + Fifty. NIFTY is an indicator of all the major companies under NSE.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The NIFTY Index displays us the top 50 trending stocks of the top 50 companies listed under NSE. </span></span></p>', '2021-06-19 17:11:38'),
(62, 'Stock market', 'stockmarket.jpeg', 'Difference between SENSEX & NIFTY', '574d624dc3bd8082969a027747eaebc9.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">NIFTY &amp; SENSEX are simplified tools which helps investors &amp; ordinary people like us to understood what exactly happens &amp; is going on in the stock market.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">And the only difference between the two i.e., <span style=\"color:#ff6842\"><u>SENSEX &amp; NIFTY is of 30 &amp; 50 companies </u></span>listed under them respectively.</span></span></p>', '2021-06-19 17:11:40'),
(70, 'Stock market', 'stockmarket.jpeg', 'How one can sell their Companies share?', '6cdba9447cc82f06bb71cd78f6b251ad.jpeg', '<p><span style=\"font-size:18px\">If any company wants to sell their shares on the stock exchange, then this is termed as &lsquo;public listing.&rsquo; If a company sell its shares for the first time in stock exchange, then it is called IPO-Initial Public Offering as the company is offering its shares to the public for the very first time.</span></p>\r\n\r\n<p><span style=\"font-size:18px\">Initially, in past it was a piece of cake to sell their companies&rsquo; shares but in todays world, this procedure is very complicated &amp; it takes a lot of time.</span></p>\r\n\r\n<p><span style=\"font-size:18px\">This is because nowadays scams have become common. Anyone can start a fake company in the stock exchange saying about all the virtues of the company &amp; claiming that it has so much of value, will blabber about its achievement. They&rsquo;ll just lie to the people &amp; believing in them the public will foolishly invest in their company &amp; then they might flee away with all those money. &nbsp;&nbsp;&nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:18px\">So, scam is common now, &amp; India in history has been a prey to such scam.</span></p>\r\n\r\n<p><span style=\"font-size:18px\">For e.g. The Harshad Mehta Scam, the Satyam Scam, etc. This were the scams who listed their companies name in stock exchange, fooled the people, collected the money &amp; then flew away.</span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">And slowly alowly as this scams keep on happening, the Stock Exchange realized that they need to make their procedure stronger&nbsp; scam proof. So, they made strict regulation &amp; rules which lead to a very complicated norms,today.&nbsp;&nbsp; </span></span></p>', '2021-06-24 08:23:54'),
(71, 'Stock market', 'stockmarket.jpeg', 'SEBI', '4a4fd0c20eaa269da9505509e6d0a496.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u>Security &amp; Exchange Board Of India</u></span>, it&rsquo;s a regulatory body which look after into the issues like which companies should be listed on the stock exchange &amp; whether it is done in the proper manner or not.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Amd if you want to get listed in the stock exchange then you have to fulfil the norms that&rsquo;ve been guided by SEBI.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Tgese norms are very strict &amp; are as follows:</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">1)The accounting of your company need to have lots of checks &amp; balances.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">2)Your accounts must have been checked by two Auditors.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">3)It can take almost three years or sometimes, even more for this process.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">4)For publicly listing of the company, it should have more than 50 shareholders pre-present in the company.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">5)While sharing your shares, amongst public, if there is no demand of it then the SEBI can remove your company from the Stock market list.</span></span></p>', '2021-06-24 08:23:51'),
(72, 'Stock market', 'stockmarket.jpeg', 'How to Buy Shares?', 'f641f845e0e8348fefc2c22c42b4c908.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Now the question arises, how one can invest in the Stock market?</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Before the arrival of Internet, one has to physically go to BSE or NSE building for selling or buying of shares.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">But with the Internet we need only three things -<span style=\"color:#ff6842\"><u>a Bank a/c, trading a/c &amp; a demat a/c</u></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">A bank account because you would need your money. Trading account is needed so that you can invest money in a company &amp; Demat account is necessary for storing the stocks that you&rsquo;ve bought, in digital form.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">People like us would be called as retail investors, i.e., common people who want to invest in the stock market. So, retail investors always need a broker. Broker is the person who brings buyer &amp; seller together. He is a person who is licensed to trade in shares. They&rsquo;ve direct access to the share market &amp; can act as your agent in share transactions. For this service they charge a fee i.e., brokerage.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">This brokerage rate charged by banks is 1%, which is bit too high whereas there are platforms who charge brokerage rate around 0.5% or 0.1%. The brokerage rate is a disadvantage for the ones who mostly wants to do a lot of trading of stocks, as most of your money will vanish in this brokerage fees. But if you are planning for a long term, it would not affect your brokerage rate to a great extent.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 08:23:49'),
(73, 'Stock market', 'stockmarket.jpeg', 'Investing v/s Trading', 'eab85f268c696138e9dc83c08f38d603.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Investing &amp; Trading are two different things. Investing means putting in some amount of money in the stock market &amp; letting it stay there for some time. Trading means quickly putting in money at different places &amp; withdrawing from some places. This all happens in quick succession. Infact trading of shares is a job in itself. There are a lot of people in our country who are traders &amp; do this job all day long tasking out money from one share &amp; putting it in another. Taking it out from one place, putting it another &amp; earning profit in the process.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 08:23:46'),
(74, 'Jeff Bezos VS Elon Musk', '5d02980a6fc92002963e.jpg\n', 'The Rivals', 'abc67s.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">We humans are always curious to know about something which seems totally different to us &amp; this curiosity leads us to Space. To win the race of space, USSR &amp; USA were continuously the rivals in the past. At that time, the technology was developing up at speed &amp; it had never happened before. But forward to-day, it was all history.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">But at present, there is a Space Race going on, not between two nations but between <span style=\"color:#ff6842\"><u>the world&rsquo;s top two billionaires</u></span>. Here I&rsquo;m talking about Jeff Bezos, the founder &amp; CEO of Amazon &amp; has been the richest person of the world since 2017. Whereas, Elon Musk, the CEO of Tesla &amp; is the second richest person of the world. Companies like Paypal &amp; Tesla have reached its peak all today just because of Musk.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">This both from the starting point of their career have been each other&rsquo;s admirer but nowadays, their rivalries have been the headlines of the daily news.</span></span></p>', '2021-06-24 09:12:13'),
(75, 'Jeff Bezos VS Elon Musk', '5d02980a6fc92002963e.jpg\n', 'But how does this Space Race begin between this two?', 'ea2e19bbe62676f23ac87ce1ba3186b3.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Jeff founded Aerospace Blue Origin in 2000. Its aim was to develop cheap technology for space travel &amp; to give a boost to <span style=\"color:#ff6842\"><u>space tourism</u></span>. Whereas after two years i.e., in 2002, PayPal was acquired by e-bay, which was developed by Musk. And the money that he got from this deal, he invested it, to laid the foundation of SpaceX whose goal too was to make space travel cheap &amp; to set up a colonization on Mars.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Till 2003, they never met each other though they&rsquo;ve set up their respective aerospace companies. Finally in 2004, they&rsquo;d a meeting together to discussed about the future of aerospace but somehow that meeting didn&rsquo;t go well. From then, they appeared to keep it to themselves.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 09:08:13'),
(76, 'Jeff Bezos VS Elon Musk', '5d02980a6fc92002963e.jpg\n', 'The Fight over Nasas Launchpad & Drone Ships', '04ea10905b39e185a1bf4e53ed4feb19.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><u>U</u>ntil &amp; unless in 2013, their rivalry continued when things became debatable over renting a NASA launchpad. So, Jeff wrote letters to American Government saying that SpaceX should not get NASA&rsquo;s launchpad for 20 years but all his efforts gone in vain after SpaceX successfully won the NASA&rsquo;s launchpad.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 2010 Bezos applied for the patent of Drone ships, which are used for landing rocket boosters. In 2014, SpaceX made sure that this patent should got invalidate &amp; guess what by 2015, SpaceX again won, this leads their relationship becoming worse &amp; then they became each other&rsquo;s biggest rivalries.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Between all this, once Jeff on a T. V show, was asked about the Musk&rsquo;s idea of Mars colonization, to which Jeff said, &ldquo;those who want to be on Mars, first they should climb Mt.Everest.&rdquo;</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">But practically, SpaceX has been very much successful in the launching of Rockets &amp; in reusing them then Blue Origin. Blue Origin is far behind than SpaceX.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 09:08:18'),
(77, 'Jeff Bezos VS Elon Musk', '5d02980a6fc92002963e.jpg\n', 'The difference in their Future Goals', '0a836c6268c35c097d39b0a69eddaf21.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">If we talk about their future goals, Musk sees, that by 2024, he&rsquo;ll be able to send humans on Mars whereas Jeff&rsquo;s Blue Origin wants to colonize in Space &amp; they are working on the best tourism plan which will <span style=\"color:#ff6842\"><u>cost 1 or 2 crore per person to travel</u></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">As a question, who&rsquo;s winning this race is not predictable but the way SpaceX is doing one after the other great jobs, due to which we can say that SpaceX is much ahead of Blue Origin.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 09:08:20'),
(78, 'Google', 'google.jpg', 'Why theyve developed their products & apps?', 'bc033e041851601abdd25166a2750574.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Google says, &ldquo;Our Mission is to organise the world&rsquo;s information &amp; make it universally accessible &amp; useful.&rdquo; And they&rsquo;ve literally shown us by developing Products &amp; apps such as Android Auto, Android TV, Google Cardboard, Google Chromebook, Google Home &amp; many more added on their list..</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Google commits to significally improve the lives of as many people as possible.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">They fulfil their commitments by :</span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"color:#ff6842\"><u><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Protecting users</span></span></u></span></li>\r\n	<li><span style=\"color:#ff6842\"><u><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Expanding Opportunities</span></span></u></span></li>\r\n	<li><span style=\"color:#ff6842\"><u><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Including all voices</span></span></u></span></li>\r\n	<li><span style=\"color:#ff6842\"><u><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Responding to crisis</span></span></u></span></li>\r\n	<li><span style=\"color:#ff6842\"><u><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Advancing sustainability</span></span></u></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">As a consequence, Google provides Information &amp; many more things to its users in moments of needs through their products &amp; services.</span></span></p>', '2021-06-26 17:42:49'),
(79, 'Google', 'google.jpg', 'Android Auto', 'e379632253c3e1235fb56c4b5757e723.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Android Auto is a mobile app developed to mirror features of an Android device, such as a smartphone, on a cars dashboard information &amp; entertainment head unit.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">When you connect your phone to your car display &ndash; your android apps show up onscreen, just like that. You can just tap on the cars dashboard to get the driving directions or even call your Mom, hands-free. Android Auto is made to help you focus on the road. And have fun along the way. Just plug in &amp; go.</span></span></p>', '2021-06-24 10:17:45'),
(80, 'Google', 'google.jpg', 'Android TV', 'ef25232d779f608ca3be5fb47ed84525.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Android TV is a smart TV operating system based on android &amp; developed by google for television sets, digital media players, set top boxes &amp; sound bars.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">When you&rsquo;ll switch on your Android TV , you&rsquo;ll see the main screen/home screen, it is filled with a vertical stream of rows from left to right. The top row consists of the popular apps you use. You can watch your favourite content from Youtube, a web series from Netflix or MX Player or play Subway Surfer just on TV by downloading it from Google Play Store.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Its simply designed to bring the sorts of things you enjoy on your phone to your TV. That doesn&rsquo;t mean that you&rsquo;ve to go through your phone calls or e-mails but gives access to entertainment. It makes your TV smart &amp; easy to use.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 10:17:42'),
(81, 'Google', 'google.jpg', 'Google Cardboard', '4c9a17f853033b54557ce49df2fb6f8b.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Virtual Reality (VR) is the use of computer technology to create a simulated environment. VR places the user inside an experience. Users are able to interact with<span style=\"color:#ff6842\"><u> 3D world </u></span>&amp; are immersed, instead of viewing a screen in front of them.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">And for the same, google has developed Google Cardboard, a virtual reality platform. It is named as Cardboard for its fold-out cardboard viewer into which a smartphone is inserted. <span style=\"color:#ff6842\"><u>Google Cardboard is a VR construct </u></span>that allows users to block out external visual stimuli &amp; focus on their device screen.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Cardboards two plastic acrylic lenses makes the experience more believable by mimicking the way our eyes process the real world. Also, the flaps on the side, block distractions to ensure that the eyes stay focused on whatever appears within those areas (I.e., on the screen).</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Once you have it, you fold it into shape, pop your mobile device into it, cue-up the VR friendly app of your choice &amp; hold it up to your head to start your VR experience. </span></span></p>', '2021-06-24 10:17:47'),
(82, 'Google', 'google.jpg', 'Chromebook', '6af73be40867ecd9416571f951be2eb5.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u>A Chromebook is a laptop or tablet running the Linux-based Chrome OS as its operating system</u></span>. They also go light on hard drive size because they store most of their data in the Cloud.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">If most of your PC activity is stuff like browsing Facebook, Youtube, Netflix &amp; other online tasks- get a Chromebook. Those with higher end needs will need to really pay up to get a Super Chromebook which can cost around $700.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Google Chromebook are primarily used to perform a variety of tasks using the Google Chrome Browser. They are designed to help you get things done faster &amp; easier.</span></span></p>', '2021-06-24 10:17:51'),
(83, 'Google', 'google.jpg', 'Chrome Enterprise', '5af3ad97f680ff5ef618190ab1752e51.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Enterprises i.e., firms are choosing to move to a modern browser because the way we work is changing &amp; the evolving of the web in enterprise has a large part to play in this.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">So, Google Chrome Enterprises is the business focused solutions for Chrome devices, Chrome browsers &amp; Chrome OS. Chrome Enterprise offers cloud based management tools, integrations with third party &amp; 24/7 support for IT administrators. This browser is no longer just a means of accessing the internet, it is visited to enterprise productivity &amp; security. It protects company data &amp; users while making sure employees can work without interruption.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Also, safe browsing on Chrome Enterprise enables warnings to appear automatically when users attempt to navigate to dangerous sites or download malicious files. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Lastly, it&rsquo;s easy-to-control policies help IT meet security &amp; compliance needs &amp; maintain user productivity. </span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 10:17:49'),
(84, 'Google', 'google.jpg', 'Google Home', '8d081a49a086faff9d3a5455f7344840.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Google Nest or Google Home speakers or displays make life easier by helping you do things like access media, manage your tasks &amp; plan your day using only your voice.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Google Nest was previously named Google Home. Under, the Google Nest brand , a line of smartest speakers has been developed. To interact with services, this devices enables users to listen to music, control playback of videos or photos, receiving news updates entirely by voice. This device also supports home automation, letting users control smart appliances just with their voice command.</span></span></p>', '2021-06-24 10:17:54'),
(85, 'Google', 'google.jpg', 'Google Drawings', 'db28960cf09fe39e7ca5367d9030e1d4.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Google drawings is a diagramming software included as a part of the free, web-based Google Docs Editors suite offered by Google. It is available as a web application &amp; as a desktop application on Google&rsquo;s Chrome OS. On this app, <span style=\"color:#ff6842\"><u>you can create &amp; edit flowcharts, organizational charts, mind maps, concept maps &amp; many types of diagrams online.</u></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Often, Google Drawings is overlooked as being a simple graphic program, offering not much more functionally then Microsoft Paint.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-06-24 10:17:55'),
(86, 'Illuminati', '88325949e7ec27958351750b5b2b1a89.jpeg', 'The Secret Society', '7e9eeba88b5e66f7407c64c4f1278935.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">What if I told you that apart from the society we live in, there is secretly another society called as<span style=\"color:#ff6842\"><strong> <u>Illuminati</u></strong></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Illuminati, this world is itself <span style=\"color:#ff6842\"><u><strong>mysterious</strong></u></span> as well as very old. People are afraid to talk about the word Illuminati. It is believed, the 70% of world&rsquo;s richest people are members of Illuminati.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">It was established by a German Philosopher, Adam Weishaupt on 1<sup>st</sup> May 1776 with more other five people. This society was started to spread Enlightment era <span style=\"color:#ff6842\"><u><strong>ideas</strong></u></span>. And later on, it got increased day by day &amp; people joined in numbers.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Illuminati managed to recruit between 650 &amp; 2500 members in Bavaria, around the year 1784.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">A Christian cult known as Rosicurcianism opposed the idea of an enlightened rational movement as they were very religious.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">After being accused of publishing anti-religious literature, the Bavarian Government <span style=\"color:#ff6842\"><u><strong>banned</strong></u></span>&nbsp; all the secret societies &amp; seized the important documents from the illuminati&rsquo;s founders. This effectively <span style=\"color:#ff6842\"><u><strong>ended</strong></u></span> the existence of the group Illuminati. But after few years, once again it came to us, that not only Illuminati still exists in <span style=\"color:#ff6842\"><u><strong>secret</strong></u></span> but they were illegaly responsible for many International Events.</span></span></p>', '2021-08-01 18:09:28');
INSERT INTO `knowledges` (`knowledgesrno`, `maintopic`, `maintopicphoto`, `topicheading`, `topicphoto`, `topicdetails`, `written_at`) VALUES
(87, 'Illuminati', '88325949e7ec27958351750b5b2b1a89.jpeg', 'Whats the aim of this group?', 'acb4214ef7b78e3637e67319027e8fb6.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">To answer this question, simply , this group wants to <span style=\"color:#ff6842\"><u><strong>rule</strong></u></span> the world. It is consisted of <span style=\"color:#ff6842\"><u><strong>powerful</strong></u></span> people who wants the world should bow in front of them. This society creates circumstances between two people around &amp; make them differentiate &amp; then on the basis of <span style=\"color:#ff6842\"><u><strong>Evil</strong></u></span> &amp; <span style=\"color:#ff6842\"><u><strong>money</strong></u></span> power they want them to be a member of their secret Society Illuminati.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Also, this society believes in <span style=\"color:#ff6842\"><u><strong>Satan</strong></u></span> rather than God. Another point to add is, if you see anyone, making or wearing a <span style=\"color:#ff6842\"><u><strong>shape of Triangle</strong></u></span>, its assumed that they are the members of the group Illuminati.&nbsp; But the members are not allowed to showcase their <span style=\"color:#ff6842\"><u><strong>membership</strong></u></span> publically otherwise, they are sentenced to death. And yeah, it&rsquo;s a different thing if someone is using Illuminati&rsquo;s symbol for attention. </span></span></p>', '2021-08-01 18:20:16'),
(88, 'Online banking', '896b3b4e17d665807a3c5d59b6bf1403.jpeg', 'Time Convenient but at times not Secured', '2849bb4cc02db1e572de77da3cc78c33.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Online Banking also known as<span style=\"color:#ff6842\"><u><strong> internet banking</strong></u></span> gives us the ability to manage our bank accounts from anywhere around the world, by a computer or a mobile device over the <span style=\"color:#ff6842\"><u><strong>internet</strong></u></span>. There&rsquo;s no need to visit a bank branch. We can do the transaction any time we feel <span style=\"color:#ff6842\"><u><strong>convenient</strong></u></span> no need to<span style=\"color:#ff6842\"><u><strong> wait </strong></u></span>for the normal banking hours.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In online banking, we typically pay bills, transfer funds, verify transactions &amp; many more. Also, we can open any type of <span style=\"color:#ff6842\"><u><strong>account </strong></u></span>online without feeling the need to visit to bank &amp; providing physical paper or signing in. with the help of <span style=\"color:#ff6842\"><u><strong>electronic signature </strong></u></span>capability, the entire process now takes less than 10 minutes.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The advantage of online banking is that we get <span style=\"color:#ff6842\"><u><strong>alerts</strong></u></span>, we receive a text or e-mail our bank notices <span style=\"color:#ff6842\"><u><strong>fraud</strong></u></span> activity or our balance goes down, below a certain amount. This alert helps us to quickly solve the <span style=\"color:#ff6842\"><u><strong>criminal</strong></u></span> actions. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">As there are virtues, there are<span style=\"color:#ff6842\"><u><strong> drawbacks </strong></u></span>to. There is a risk that your account might got <span style=\"color:#ff6842\"><u><strong>hacked</strong></u></span> attacks on online banking today are based on deceiving the user to steal login data. <span style=\"color:#ff6842\"><u><strong>Phishing &amp; Pharming</strong></u></span> are two wellknown attacks. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">At times due to a glitch in bank&rsquo;s system, there are chances that your <span style=\"color:#ff6842\"><u><strong>transaction</strong></u></span> might not take place &amp; due to <span style=\"color:#ff6842\"><u><strong>malfunctions</strong></u></span>, also the data sometimes shown is improper which gives a mini heart attack, After all it&rsquo;s a matter of money.</span></span></p>', '2021-08-02 14:38:54'),
(89, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Motorola over Nokia', '9f0a2207ec9ded5e1dff3fb501a98d44.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\">From childhood, we&rsquo;ve been listening that <span style=\"color:#ff6842\"><u><strong>Nokia </strong></u></span>is the first mobile company, but its not true. Before, <span style=\"color:#ff6842\"><u><strong>Motorola </strong></u></span>was the world&rsquo;s <span style=\"color:#ff6842\"><u><strong>biggest</strong></u></span> phone seller. In 1991, it was Motorola who launched <span style=\"color:#ff6842\"><u><strong>iDen</strong></u></span>, i1000 plus, the first mobile in<span style=\"color:#ff6842\"><u><strong> history</strong></u></span> to feature a two-way radio, e-mail &amp; Internet. Nokia took over the number one spot in 1998.</span></span></span></p>', '2021-08-02 16:27:05'),
(90, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Peter Thiel- Investor of Facebook', '0866aa4fb6a7462380abbe342dd8f38e.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\"><span style=\"color:#ff6842\"><u><strong>Peter Thiel</strong></u></span>, co-founder of <span style=\"color:#ff6842\"><u><strong>PayPal</strong></u></span> was the first person to invest in <span style=\"color:#ff6842\"><u><strong>Facebook.</strong></u></span> He invested 5,00,000 USD i.e., 3,71,40,600 in rupees, it&rsquo;s a big amount.</span></span></span></p>', '2021-08-02 16:26:45'),
(91, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Youtube - A Dating Site', 'f9a5b28b67e9a0b4a9d465e5522a9e96.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\">We know Youtube as an online video platform, but the fact is <span style=\"color:#ff6842\"><u><strong>initial </strong></u></span>version of Youtube was a dating site. A Dating Site named <span style=\"color:#ff6842\"><u><strong>&ldquo;Tune in Hook Up&rdquo;</strong></u></span></span></span></span></p>', '2021-08-02 16:26:30'),
(92, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Samsung is manufactured in the firms own factory', '344d8c269978cc5433a78bdce8b05c11.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\">A large majority of<span style=\"color:#ff6842\"><u><strong> SAMSUNG </strong></u></span>Products, around 90% are produced in the firms<span style=\"color:#ff6842\"><u><strong> own</strong></u></span> factories. Also, SAMSUNG was the first firm in history to<span style=\"color:#ff6842\"><u><strong> sell</strong></u></span> the watch phone, digital television &amp; mp3 player.</span></span></span></p>', '2021-08-02 16:26:10'),
(93, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Googles Search Page - Simple, why?', '77bde726d1c9f1d44256607560e7d157.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\">You&rsquo;ve visited <span style=\"color:#ff6842\"><u><strong>Google </strong></u></span>every now &amp; then, but ever <span style=\"color:#ff6842\"><u><strong>wondered</strong></u></span> why the search page is so <span style=\"color:#ff6842\"><u><strong>simple</strong></u></span>? Its because the Google&rsquo;s founder had no knowledge of <span style=\"color:#ff6842\"><u><strong>HTML</strong></u></span> &amp; this resulted in a Simple Search Google Page, that&rsquo;s <span style=\"color:#ff6842\"><u><strong>strange.</strong></u></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18pt\">In present, some <span style=\"color:#ff6842\"><u><strong>features </strong></u></span>have been added but nothing else has changed.</span></span></span></p>', '2021-08-02 16:25:48'),
(94, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Wondered what was Googles first Tweet?', '238155ddc9acb430a749b095e2cddcb7.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\">The first tweet posted by Google was in <span style=\"color:#ff6842\"><u><strong>Binary System</strong></u></span>. That Binary code when decode will say <span style=\"color:#ff6842\"><u><strong>&ldquo;I&rsquo;m Feeling Lucky.&rdquo; </strong></u></span></span></span></span></p>', '2021-08-02 17:39:08'),
(95, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Apple Company Related to Satan?', 'e361fca8a7f402b2abf63685a914c1b2.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The first Computer sold by apple was priced at <span style=\"color:#ff6842\"><u><strong>666.66 USD</strong></u></span>, which is said to be the number of <span style=\"color:#ff6842\"><u><strong>Satan</strong></u></span>, its weird!!&nbsp; One more thing to add here is, the retina display of <span style=\"color:#ff6842\"><u><strong>iPad</strong></u></span> is actually a <span style=\"color:#ff6842\"><u><strong>SAMSUNG</strong></u></span> production.</span></span></p>', '2021-08-02 16:31:28'),
(96, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Nokia doesnt like 4', '93a2a7074cd2664158cb45d9fd327521.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Nokia </strong></u></span>does not use the number <span style=\"color:#ff6842\"><u><strong>&lsquo;4&rsquo;</strong></u></span> while <span style=\"color:#ff6842\"><u><strong>naming </strong></u></span>any of its product in Asia as they believe, its not a lucky number, that&rsquo;s<span style=\"color:#ff6842\"><u><strong> superstitious</strong></u></span>.</span></span></p>', '2021-08-02 16:40:31'),
(97, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Nokias phone - First GSM call', '2f73f0f10b5350870b0f1bd00aa2b69a.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\">The first <span style=\"color:#ff6842\"><u><strong>GSM</strong></u></span> commercial call was made by <span style=\"color:#ff6842\"><u><strong>Finnish</strong></u></span> Prime Minister Harry Holkari from a <span style=\"color:#ff6842\"><u><strong>Nokia</strong></u></span> Phone, ofcourse.</span></span></span></p>', '2021-08-02 17:17:29'),
(98, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Twitter - Limits 140 character', '615d36f1a17b7d510cf2f6fb2969ff5c.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The reason behind <span style=\"color:#ff6842\"><u><strong>Twitter&rsquo;s</strong></u></span> 140 character <span style=\"color:#ff6842\"><u><strong>limit </strong></u></span>lies in its beginning as an<span style=\"color:#ff6842\"><u><strong> SMS</strong></u></span> Service.</span></span></p>', '2021-08-02 17:21:24'),
(99, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'MS Paint to Paint 3D', '0e96e684232c203f65d5cc4528d857d0.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>MS Paint</strong></u></span> was something, we crave a lot in our childhood. Whenever, we sit on computer, the first thing we use was MS Paint. However, the fact is back in 2017, MS Paint was officially declared <span style=\"color:#ff6842\"><u><strong>dead</strong></u></span> &amp; was <span style=\"color:#ff6842\"><u><strong>replaced</strong></u></span> by Paint 3D. </span></span></p>', '2021-08-02 17:25:56'),
(100, 'Known techno companies, unknown facts', '71742dd2a9828faa2f86df4f37ae85f9.jpeg', 'Linux OS - The Super Computers Power', '8903e700b9c5e2c3cf4e9a3b308aad32.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Lets believe, there are 500 <span style=\"color:#ff6842\"><u><strong>super computers</strong></u></span> in world, but the fact is only 2 of the super computer uses <span style=\"color:#ff6842\"><u><strong>Microsoft</strong></u></span> else uses <span style=\"color:#ff6842\"><u><strong>Linux OS</strong></u></span>. As Linux OS is an <span style=\"color:#ff6842\"><u><strong>open source</strong></u></span> nature &amp; I must tell you every powerful computer&rsquo;s <span style=\"color:#ff6842\"><u><strong>first choice </strong></u></span>is Linux OS.&nbsp; </span></span></p>', '2021-08-02 17:29:27'),
(101, 'Mark Zuckerberg', '11a307f6a600293e3484a467607bc8b0.jpeg', 'Who is he ?', 'f89d508e4974e4c6ddca82394bb27d2d.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Mark Elliot Zuckerberg</strong></u></span> is the cofounder &amp; CEO of<span style=\"color:#ff6842\"><u><strong> Facebook</strong></u></span>. The man who thought of making the world more transparent, &ldquo;By giving people the power to <span style=\"color:#ff6842\"><u><strong>share</strong></u></span>, we&rsquo;re making the<span style=\"color:#ff6842\"><u><strong> world </strong></u></span>more<span style=\"color:#ff6842\"><u><strong> transparent</strong></u></span>&rdquo;, and followed the simple rule of business, &ldquo;I think a simple <span style=\"color:#ff6842\"><u><strong>rule</strong></u></span> of business is, if you do the things that are <span style=\"color:#ff6842\"><u><strong>easier</strong></u></span> first, then you can actually make a lot of <span style=\"color:#ff6842\"><u><strong>progress</strong></u></span>&rdquo;. He holds 29.3% shares of facebook. Zuckerberg has a net worth of 103.6 billion USD, i.e., 10,360 crores USD as per March,2021. He was the <span style=\"color:#ff6842\"><u><strong>youngest billionaire</strong></u></span> in the world at the age of 25. <span style=\"color:#ff6842\"><u><strong>President</strong></u></span> of Facebook does not care about money. He denied a 1 Billion Dollar offering to sell Facebook. This is his <span style=\"color:#ff6842\"><u><strong>baby</strong></u></span>, he wants to keep<span style=\"color:#ff6842\"><u><strong> running</strong></u></span> &amp; keep <span style=\"color:#ff6842\"><u><strong>growing</strong></u></span> it.</span></span></p>', '2021-08-03 16:44:38'),
(102, 'Mark Zuckerberg', '11a307f6a600293e3484a467607bc8b0.jpeg', 'Early Life', '899f2041e76ab4b53dca0f0811495ce3.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">From his <span style=\"color:#ff6842\"><u><strong>childhood</strong></u></span>, Mark was fond of<span style=\"color:#ff6842\"><u><strong> Computers</strong></u></span>, from a young age he started making computer programs. His father used to help him a lot in Computer<span style=\"color:#ff6842\"><u><strong> Programming</strong></u></span> but further not being able to answer his questions, he hires an <span style=\"color:#ff6842\"><u><strong>expert</strong></u></span> computer teacher but soon the Expert teacher was <span style=\"color:#ff6842\"><u><strong>unable</strong></u></span> to answer Mark&rsquo;s <span style=\"color:#ff6842\"><u><strong>questions</strong></u></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">At the age of 12, Mark created a messenger named <span style=\"color:#ff6842\"><u><strong>&lsquo;Zucknet&rsquo;.</strong></u></span> He uses Zukenet to talk to his <span style=\"color:#ff6842\"><u>father</u></span> when he was in clinic. He also used his<span style=\"color:#ff6842\"><u><strong> creativity</strong></u></span> to build<span style=\"color:#ff6842\"><u><strong> games </strong></u></span>by which his friends often get drawn.</span></span></p>', '2021-08-03 16:56:11'),
(103, 'Mark Zuckerberg', '11a307f6a600293e3484a467607bc8b0.jpeg', 'Hardward Univesity', '757f31f0da8c8d0fdc17c1eb91673351.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Afterwards, he took admission in <span style=\"color:#ff6842\"><u><strong>Hardvard University</strong></u></span>, being an intelligent student, people ther call him as an &lsquo;<span style=\"color:#ff6842\"><u><strong>Programming Expert</strong></u></span>&rsquo;.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">There he built a program called <span style=\"color:#ff6842\"><u><strong>Course Match</strong></u></span>, which helped students choose their classes based on the course selections of other users &amp; also to help them form study groups.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">He also invented &lsquo;<span style=\"color:#ff6842\"><strong><u>Face Mash</u></strong></span>&rsquo;, which compared the pictures of two students on campus&nbsp; &amp; allowed users to vote on which one was more attractive. The program became widely <span style=\"color:#ff6842\"><u><strong>popular</strong></u></span>, but was later <span style=\"color:#ff6842\"><u><strong>shut</strong></u></span> down by the University Administration after it was deemed <span style=\"color:#ff6842\"><u><strong>inappropriate</strong></u></span>.</span></span></p>', '2021-08-03 17:02:54'),
(104, 'Mark Zuckerberg', '11a307f6a600293e3484a467607bc8b0.jpeg', 'The Change of Era  Facebook', '847e665354d38083e0b87959a4b065ff.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 2004, he began writing a new computer programming which he called <span style=\"color:#ff6842\"><u><strong>&lsquo;The Facebook&rsquo;</strong></u></span> along with Eduardo Saverin, Andrew McCollum, Chris Hughes &amp; Dustin Moskavitz, the co-founders of &lsquo;The Facebook&rsquo;.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Facebook was<span style=\"color:#ff6842\"><u><strong> famous</strong></u></span> only in<span style=\"color:#ff6842\"><u><strong> Harvard</strong></u></span> but slowly &amp; steadily got famous in other <span style=\"color:#ff6842\"><u><strong>Universities</strong></u></span> too. The Facebook <span style=\"color:#ff6842\"><u><strong>popularity</strong></u></span> was rapidly increasing, seeing this Mark decided that now not only students but the whole<span style=\"color:#ff6842\"><u><strong> world </strong></u></span>will use &lsquo;The Facebook&rsquo;. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">And with this decision he <span style=\"color:#ff6842\"><u><strong>left </strong></u></span>his studies in the middle &amp; with an intense dedication, day &amp; night hard work, he kept himself engaged in <span style=\"color:#ff6842\"><u><strong>developing</strong></u></span> &lsquo;The Facebook&rsquo; &amp; finally took it to another level.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">By 2005, &lsquo;The Facebook&rsquo; was renamed as <span style=\"color:#ff6842\"><u><strong>&lsquo;Facebook&rsquo;.</strong></u></span> By 2006, there were 1 lakh companies listing their business on facebook &amp; creating pages. By 2011, it became the largest <span style=\"color:#ff6842\"><u><strong>photograph force</strong></u></span> &amp; had over 350 million people accessing the website. In 2013, Facebook made the Fortune 500 list for the first time making Zuckerberg, at the age of 28, the <span style=\"color:#ff6842\"><u><strong>youngest CEO</strong></u></span> on the list.<span style=\"background-color:white\"><span style=\"color:#202122\">The company celebrated its 10th anniversary during the week of February 3, 2014.In January 2014, over one billion users connected via a mobile device.As of 2015, Facebook&#39;s algorithm was </span><span style=\"color:#ff6842\"><u><strong>revised </strong></u></span><span style=\"color:#202122\">in an attempt to filter out false or </span><span style=\"color:#ff6842\"><u><strong>misleading </strong></u></span><span style=\"color:#202122\">content, such as</span><span style=\"color:#ff6842\"><u><strong>&nbsp;fake&nbsp;</strong></u></span></span><u><strong><span style=\"color:#ff6842\">news</span></strong></u><span style=\"background-color:white\"><span style=\"color:#ff6842\"><u><strong>&nbsp;</strong></u></span><span style=\"color:#202122\">stories and </span><span style=\"color:#ff6842\"><u><strong>hoaxes</strong></u></span><span style=\"color:#202122\">.&nbsp;On June 29, 2021 Facebook announced</span><span style=\"color:#ff6842\"><strong><u>&nbsp;Bulletin</u></strong></span></span><span style=\"background-color:white\"><span style=\"color:#202122\">, a platform for independent </span><span style=\"color:#ff6842\"><u><strong>writers.</strong></u></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#202122\">Its saved to say that Facebook add its </span><span style=\"color:#ff6842\"><u><strong>creator</strong></u></span><span style=\"color:#202122\"> Mark Zuckerberg by two of the 21<sup>st</sup> century&rsquo;s the most influential, controversial &amp; potentially powered figure.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-08-03 17:18:48'),
(105, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'What is Government ?', 'a2fc3e0d80ee441028aeedd1db99fa0d.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">A Government is a <span style=\"color:#ff6842\"><u><strong>group</strong></u></span> of people that have <span style=\"color:#ff6842\"><u><strong>power</strong></u></span> to rule in a <span style=\"color:#ff6842\"><u><strong>territory</strong></u></span>, according to the<span style=\"color:#ff6842\"><u><strong> law</strong></u></span>. This territory may be a country, a state or province within a country or a region. It is a system of <span style=\"color:#ff6842\"><u><strong>social control</strong></u></span> under which the right to <span style=\"color:#ff6842\"><u><strong>make </strong></u></span>laws, &amp; the right to <span style=\"color:#ff6842\"><u><strong>enforce </strong></u></span>them is given to a particular group in <span style=\"color:#ff6842\"><u><strong>society</strong></u></span>. Government power can be held by one<span style=\"color:#ff6842\"><u><strong> individual</strong></u></span>, a few or a <span style=\"color:#ff6842\"><u><strong>majority. </strong></u></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Governments come in different forms. The basic law determining the form of government is called the <span style=\"color:#ff6842\"><u><strong>Constitution</strong></u></span>.</span></span></p>', '2021-08-09 11:06:33'),
(106, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'What is Constitution?', 'd278154dd6a6290e93fcc000b3edad4b.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Almost everything we do is <span style=\"color:#ff6842\"><u><strong>governed </strong></u></span>by some set of <span style=\"color:#ff6842\"><u><strong>rules</strong></u></span>. Some rules that are made by the<span style=\"color:#ff6842\"><u><strong> legislatures</strong></u></span>(also known as Lok Sabha/Rajya Sabha in India), for their own country, are called<span style=\"color:#ff6842\"><u><strong> &ldquo;Law&rdquo;</strong></u></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">We need Laws in<span style=\"color:#ff6842\"><u><strong> Society</strong></u></span></span></span><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;so our Society can regulate &amp; work properly. They are designed to<span style=\"color:#ff6842\"><u><strong> protect</strong></u></span> us &amp; our property &amp; to ensure that everyone in society behaves the way that the <span style=\"color:#ff6842\"><u><strong>community </strong></u></span>expects them too.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>document</strong></u></span> containing laws &amp; rules which determine &amp; describe the form of the Government, the relationship between the citizens, &amp; the government, is called a<span style=\"color:#ff6842\"><u><strong> Constitution</strong></u></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Laws tell us what to expect as a <span style=\"color:#ff6842\"><u><strong>consequence</strong></u></span> of our <span style=\"color:#ff6842\"><u><strong>actions</strong></u></span>. Laws have been the <span style=\"color:#ff6842\"><u><strong>glue</strong></u></span> that has kept society <span style=\"color:#ff6842\"><u><strong>together. </strong></u></span></span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-08-04 15:32:11'),
(107, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'What is the Constitution of India?', 'eb884e48ac32b0fddd2842b94d71d19f.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Constitution of India</strong></u></span> is considered to be the <span style=\"color:#ff6842\"><u><strong>Supreme </strong></u></span>Law of the country, as it put forth the <span style=\"color:#ff6842\"><u><strong>framework</strong></u></span> of fundamental political <span style=\"color:#ff6842\"><u><strong>principles</strong></u></span>. It establishes the structure, procedures, powers &amp; duties of the government &amp; mentions the fundamental rights, directive principles &amp; duties of<span style=\"color:#ff6842\"><u><strong> Citizens.</strong></u></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Constitution declares India as a Sovereign, Socialist Democratic, &amp;Republic with a <span style=\"color:#ff6842\"><u><strong>parliamentary </strong></u></span>form of Government.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Indian Constitution shows Federal as well as Unitary System.</span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Federal System</strong></u></span> - powers are <span style=\"color:#ff6842\"><u><strong>divided</strong></u></span> and/or <span style=\"color:#ff6842\"><u><strong>shared </strong></u></span>between state &amp; central governments.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Union System</strong></u></span> - power <span style=\"color:#ff6842\"><u><strong>concentration</strong></u></span> in central government with weak state government.</span></span></li>\r\n</ol>', '2021-08-04 15:39:02'),
(108, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Features of Federal & Unitary System', '6b2c340787c5f4107693238f02dfa88d.jpeg', '<p><span style=\"color:#ff6842\"><u><strong><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Federal Features</span></span></strong></u></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Supremacy<span style=\"color:#ff6842\"> </span>of the Constitution.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Division of power between the union (Central Government ) &amp; State.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The existence of an independent judiciary in the Indian Constitution.</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"color:#ff6842\"><u><strong><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Unitary Features</span></span></strong></u></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Single Citizenship</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Single Constitution</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Power of Union to override on the state matters.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">During emergency the system became virtually unitary.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Changes in the names &amp; boundaries of the States by the Parliament.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Integrated Judiciary System.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Centre appoints the Governor.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Dependence of states on the center for economic assistance &amp; grants.</span></span></li>\r\n</ol>', '2021-08-04 15:47:44'),
(109, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Government of India', '6172a5847c1a606224f8365d292ee035.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">The <span style=\"color:#ff6842\"><u><strong>Indian Government </strong></u></span>is divided into <span style=\"color:#ff6842\"><u><strong>three</strong></u></span> distinct but interrelated<span style=\"color:#ff6842\"><u><strong> branches</strong></u></span> : Legislative, Executive &amp; Judiciary &ndash; have to <span style=\"color:#ff6842\"><u><strong>function</strong></u></span> within their own spheres <span style=\"color:#ff6842\"><u><strong>demarcated </strong></u></span>under the <span style=\"color:#ff6842\"><u><strong>Constitution.</strong></u></span> In other words, the doctrine of <span style=\"color:#ff6842\"><u><strong>Separation of powers</strong></u></span> has been implicitly recognized by the Indian Constitution.</span></span></p>', '2021-08-09 11:32:31'),
(110, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Legislature', '0d7703cafda8f73a551cb389e3b1f750.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Legislative</strong></u></span> means having the power to make <span style=\"color:#ff6842\"><u><strong>laws</strong></u></span> &amp; <span style=\"color:#ff6842\"><u><strong>Legislature </strong></u></span>is the legislative body of a country or state. Legislature is <span style=\"color:#ff6842\"><u><strong>elected</strong></u></span> by people &amp; work on behalf of the <span style=\"color:#ff6842\"><u><strong>people</strong></u></span>. They are empowered &amp; make laws for us. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The<span style=\"color:#ff6842\"><u><strong> Parliament</strong></u></span> of India is the <span style=\"color:#ff6842\"><u><strong>Supreme </strong></u></span>legislative body in India. The Parliament comprises, the President of India&nbsp; &amp; two houses, Lok Sabha (House of the People) &amp;Rajya Sabha (Council of States).&nbsp; The<span style=\"color:#ff6842\"><u><strong> Lok Sabha </strong></u></span>consists of members who are directly elected representatives of the people, while the<span style=\"color:#ff6842\"><u><strong> Rajya Sabha</strong></u></span> is composed mainly of representatives of the states, Legislative Assemblies.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Each house has to meet within six months of its previous sittings. A joint of two houses can be held in certain cases.</span></span></p>', '2021-08-04 16:06:50'),
(111, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Lok  Sabha', 'beabf0ae7d0a6e6b3421ca2df31a3f57.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Lok Sabha </strong></u></span>or House of the People is the <span style=\"color:#ff6842\"><u><strong>lower house </strong></u></span>of the Parliament of India. The Members of Lok Sabha are directly <span style=\"color:#ff6842\"><u><strong>elected</strong></u></span> by the people. The Lok Sabha meets in the Lok Sabha Chambers, Sansad Bhavan, Sansad Marg, New Delhi. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Lok Sabha is the<span style=\"color:#ff6842\"><u><strong> centre</strong></u></span> of political <span style=\"color:#ff6842\"><u><strong>activity</strong></u></span> in India because it is a chamber consisting of members elected by Indian <span style=\"color:#ff6842\"><u><strong>Citizens</strong></u></span>, on the basis of Universal Adult Franchise.<span style=\"color:#ff6842\"><u><strong> Universal Adult Franchise</strong></u></span> means that all Indian Citizens above the age of 18 have to elect their representatives. Popular<span style=\"color:#ff6842\"><u><strong> opinion</strong></u></span> is reflected in, &amp; expressed by, the members of the Lok Sabha.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">When the Constitution was framed, it was laid down that the Lok Sabha cannot consist of more than 500 members, the number being based on <span style=\"color:#ff6842\"><u><strong>Population</strong></u></span> figures. The strength of Lok Sabha was increased, with the rise in population of the country. The present strength of the Lok Sabha is 545 members. They include<span style=\"color:#ff6842\"><u><strong> Anglo-Indian</strong></u></span> (<span style=\"background-color:white\"><span style=\"color:#202124\">relating to both Britain and India) members nominated by the </span><span style=\"color:#ff6842\"><u><strong>President</strong></u></span><span style=\"color:#202124\"> to represent the community.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">A <span style=\"color:#ff6842\"><u><strong>five year </strong></u></span>term has been fixed for the Lok Sabha, unless it is <span style=\"color:#ff6842\"><u><strong>dissolved</strong></u></span> earlier by the President on the advice of the Prime Minister.</span></span></p>', '2021-08-04 16:17:34'),
(112, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Qualification for the members of the Lok Sabha', '23ff426954b6e5836f4fbc6b16bf3c04.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">To be a member &nbsp;of Lok Sabha, a person must be an <span style=\"color:#ff6842\"><u><strong>Indian Citizen</strong></u></span>, must be mentally sound &amp; must have completed 25 year old of age. </span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">A Candidate may stand for election from any part of the country. </span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">No person can be a member of both houses of a<span style=\"color:#ff6842\"> Parliament</span> or of the Parliament &amp; the state <span style=\"color:#ff6842\"><u><strong>legislature</strong></u></span> at the same time.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">No member of the Parliament can hold a office of <span style=\"color:#ff6842\"><u><strong>profit </strong></u></span>under the state &amp; central governments or local authority.</span></span></li>\r\n</ul>', '2021-08-05 17:47:51'),
(113, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Speaker of Lok Sabha', '3b4923cf9457960265cc22c303065b71.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The<span style=\"color:#ff6842\"><u><strong> presiding officer</strong></u></span> of the Lok Sabha is called as the<span style=\"color:#ff6842\"><u><strong> speaker</strong></u></span>.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Lok Sabha elects its Speaker &amp; its <span style=\"color:#ff6842\"><u><strong>Deputy Speaker </strong></u></span>from among its members.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">They are both<span style=\"color:#ff6842\"><u><strong> removable</strong></u></span> by a resolution passed by a <span style=\"color:#ff6842\"><u><strong>majority</strong></u></span> of the members.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Speaker is expected to be utterly <span style=\"color:#ff6842\"><u><strong>impartial</strong></u></span>, regardless of his or her party affiliations in conducting the business of the <span style=\"color:#ff6842\"><u><strong>house</strong></u></span>.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">&nbsp;He or She <span style=\"color:#ff6842\"><u><strong>enforces</strong></u></span> discipline, protects the rights &amp; privileges of the member &amp; also the dignity of the house.</span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', '2021-08-05 18:00:54'),
(114, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Rajya Sabha', 'd78ac657947600013740626ef4eea5da.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Rajya Sabha</strong></u></span> or Council of States is the<span style=\"color:#ff6842\"><u><strong> upper house </strong></u></span>of the Parliament of India. <span style=\"color:#ff6842\"><u><strong>Membership</strong></u></span> is limited to 250 members, 12 of whom are <span style=\"color:#ff6842\"><u><strong>nominated</strong></u></span> by the <span style=\"color:#ff6842\"><u><strong>President </strong></u></span>of India for their <span style=\"color:#ff6842\"><u><strong>contributions </strong></u></span>to art, literature, science &amp; social services.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Rajya Sabha is a <span style=\"color:#ff6842\"><u><strong>permanent </strong></u></span>house &amp; is not subject to dissolution. One-third of the members of Rajya Sabha<span style=\"color:#ff6842\"><u><strong> retire</strong></u></span> after every two years in accordance with the <span style=\"color:#ff6842\"><u><strong>provisions</strong></u></span> made by the<span style=\"color:#ff6842\"><u><strong> Parliament</strong></u></span> by law. Thus, the members of the Rajya Sabha are elected for a term of six years. This arrangement ensures continuity as well as representation of the changing<span style=\"color:#ff6842\"><u><strong> public opinion</strong></u></span>.</span></span></p>', '2021-08-05 18:08:40'),
(115, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Qualification of Rajya Sabha Members', '7e2677773c463a47dd5a3c60768b1b04.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">He must be a citizen of India.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">He must not be less than 30 years of age. </span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">He must be <span style=\"color:#ff6842\"><u><strong>Parliamentary elector</strong></u></span> in&nbsp; the state from which he is seeking the election.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">He must make &amp; subscribe before some person <span style=\"color:#ff6842\"><u><strong>authorized</strong></u></span> in that behalf by the Election Commission an<span style=\"color:#ff6842\"><u><strong> oath</strong></u></span> or affirmation asserting his allegiance to the constitution of India.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">He must possess such other qualifications as may be prescribed by the <span style=\"color:#ff6842\"><u><strong>Parliament </strong></u></span>for that purpose from time to time.</span></span></li>\r\n</ul>', '2021-08-08 13:38:03'),
(116, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Powers of the Rajya Sabha', '481a49110060761fa9add14580ee8d3a.jpeg', '<ul>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">The legislative powers of the<span style=\"color:#ff6842\"><u><strong> Rajya Sabha</strong></u></span> are coordinated with the <span style=\"color:#ff6842\"><u><strong>Lok Sabha</strong></u></span>, except financial bills.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">Other bills can be introduced in either house but need to be <span style=\"color:#ff6842\"><u><strong>passed </strong></u></span>by both <span style=\"color:#ff6842\"><u><strong>houses</strong></u></span>.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">But the<span style=\"color:#ff6842\"><u><strong> Lok Sabha </strong></u></span>is more <span style=\"color:#ff6842\"><u><strong>powerful </strong></u></span>than the Rajya Sabha because it is the popularity <span style=\"color:#ff6842\"><u><strong>elected </strong></u></span>house.</span></span></span></li>\r\n</ul>', '2021-08-08 13:44:40'),
(117, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Functioning of Parliament', '35de53297e07f5ff71b81c4f5db6bc74.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Both <span style=\"color:#ff6842\"><u><strong>houses</strong></u></span> of Parliament make their own rules of <span style=\"color:#ff6842\"><u><strong>procedures</strong></u></span> for the proper<span style=\"color:#ff6842\"><u><strong> functioning </strong></u></span>of business.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Some rules are <span style=\"color:#ff6842\"><u><strong>constitutional</strong></u></span>.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Every member has to take an<span style=\"color:#ff6842\"><u><strong> oath</strong></u></span> before assuming their seat.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">For transacting the business or agenda, a quorum or minimum <span style=\"color:#ff6842\"><u><strong>attendance</strong></u></span> is required.</span></span></li>\r\n</ul>', '2021-08-08 13:52:57'),
(118, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Question Hour', 'd1bc0752d733d728e2c066657ebee482.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The first hour on every working day of the Lok Sabha is reserved for questions, this is known as <span style=\"color:#ff6842\"><u><strong>Question Hour</strong></u></span>.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Speaker </strong></u></span>can decide to cancel it, if required. </span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">When the Speaker admits a <span style=\"color:#ff6842\"><u><strong>question</strong></u></span>, it has to be <span style=\"color:#ff6842\"><u><strong>answered</strong></u></span> by the<span style=\"color:#ff6842\"><u><strong> minister</strong></u></span> concerned.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">This is to draw the attention of the people.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Questions on matter of<span style=\"color:#ff6842\"><u><strong> public interest</strong></u></span> can be asked.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">A member has to give a <span style=\"color:#ff6842\"><u><strong>notice</strong></u></span> atleast 10-days before asking the questions.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">After this the rest of the <span style=\"color:#ff6842\"><u><strong>agenda </strong></u></span>like the introduction of bills &amp; discussions on them is dealt with.</span></span></li>\r\n</ul>', '2021-08-08 13:58:51'),
(119, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Introduction of the Bill', '7ed7e03a91fcc2b9d0666449618a5d47.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Lawmaking involves several steps.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">First a bill is<span style=\"color:#ff6842\"><u><strong> introduced</strong></u></span> in the Parliament.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Second the bill is <span style=\"color:#ff6842\"><u><strong>passed</strong></u></span> by the <span style=\"color:#ff6842\"><u><strong>Parliament.</strong></u></span></span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Third, the bill, after getting passed by the Parliament is sent to the<span style=\"color:#ff6842\"><u><strong> President </strong></u></span>for his <span style=\"color:#ff6842\"><u><strong>assent.</strong></u></span></span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">When the bill is <span style=\"color:#ff6842\"><u><strong>adopted </strong></u></span>in the Parliament, it be an <span style=\"color:#ff6842\"><u><strong>Act</strong></u></span>.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">When an act gets the assent of the Parliament, it becomes the <span style=\"color:#ff6842\"><u><strong>law</strong></u></span> of the land.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">A bill is a technical name given to the draft of the proposal which is moved in Parliament.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Non-Money bills</strong></u></span> can be introduced either in the Lok Sabha or the Rajya Sabh.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">But the<span style=\"color:#ff6842\"> <u><strong>Money Bills </strong></u></span>can be introduced only in the Lok Sabha.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">A Money Bill, before it is introduced in the Lower House has to receive the <span style=\"color:#ff6842\"><u><strong>approval </strong></u></span>of the<span style=\"color:#ff6842\"><u><strong> President.</strong></u></span></span></span></li>\r\n</ul>', '2021-08-08 14:04:57');
INSERT INTO `knowledges` (`knowledgesrno`, `maintopic`, `maintopicphoto`, `topicheading`, `topicphoto`, `topicdetails`, `written_at`) VALUES
(120, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Reading of the Bill', '4583584113d4dc0c6ebb277ea101c298.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Every bill goes through three stages of reading in each houses.</span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>First Reading</strong></u></span>: Here, the aims &amp;<span style=\"color:#ff6842\"><u><strong> purposes</strong></u></span> of the bills are discussed. If these find favour with the house the bill goes to the next stage.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Second Reading</strong></u></span>: In these, <span style=\"color:#ff6842\"><u><strong>clause</strong></u></span> by clause are discussed &amp; ammendments are moved, voted &amp; debated upon.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Third Reading</strong></u></span>: It is more of a <span style=\"color:#ff6842\"><u><strong>formality</strong></u></span>. Once adopted by one house it goes to the other house for a similar procedure.</span></span></li>\r\n</ul>', '2021-08-08 14:16:00'),
(121, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Seeking the Presidents Approval', '110d2e4059091d2ef886133ceb414d02.jpeg', '<ul>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">After the bill is approved by both houses of Parliament, it is sent to the President for <span style=\"color:#ff6842\"><u><strong>Approval</strong></u></span>.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">If the President agrees with the bill, he or she <span style=\"color:#ff6842\"><u><strong>signs</strong></u></span> it &amp; the bill becomes a <span style=\"color:#ff6842\"><u><strong>law </strong></u></span>or an act.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">It is called the President&rsquo;s<span style=\"color:#ff6842\"><u><strong> assent</strong></u></span>.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">If not he or she sends it<span style=\"color:#ff6842\"><u><strong> back </strong></u></span>for the<span style=\"color:#ff6842\"><u><strong> changes</strong></u></span> to the house.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">The bill then goes to the President for approval again.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">This time the President has to <span style=\"color:#ff6842\"><u><strong>pass </strong></u></span>it.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">If one of the houses rejects a bill, the President calls for a <span style=\"color:#ff6842\"><u><strong>joint session</strong></u></span> of both houses.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">In this session the bill is accepted or rejected by a simple majority of<span style=\"color:#ff6842\"><u><strong> votes</strong></u></span>.</span></span></span></li>\r\n</ul>', '2021-08-08 14:22:36'),
(122, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Executive', 'a8ed59e70dfe54a4d71f881ea5cff62d.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Executive</strong></u></span> is the branch of government that executes the laws &amp; it includes all departments &amp; institutions that are involved in <span style=\"color:#ff6842\"><u><strong>state administration</strong></u></span>. i.e. President, ministers, administrative officials &amp; other important civil servants.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The<span style=\"color:#ff6842\"><u><strong> Union Executive </strong></u></span>carries out or ensures the laws made by<span style=\"color:#ff6842\"><u><strong> Parliament</strong></u></span>. It handles most of the day to day work of the country.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">It consist of</span></span></p>\r\n\r\n<ul>\r\n	<li style=\"list-style-type:none\">\r\n	<ul>\r\n		<li style=\"list-style-type:none\">\r\n		<ul>\r\n			<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The President</span></span></li>\r\n			<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Vice President</span></span></li>\r\n			<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Prime Minister</span></span></li>\r\n			<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Council of Ministers headed by the Prime Minister</span></span></li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:48px\">&nbsp;</p>', '2021-08-09 11:32:58'),
(123, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The President', 'ca53510a20bc4a5f6ddd6c5f120a3b6c.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>President</strong></u></span> is not the real head of the Executive.The President is only the <span style=\"color:#ff6842\"><u><strong>nominal head </strong></u></span>of the state.But the President holds the most exalted office in the country.The President is in a position of great <span style=\"color:#ff6842\"><u><strong>authority &amp; dignity.</strong></u></span></span></span></p>', '2021-08-08 14:34:14'),
(124, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Vice President', '470685f29b4a5ca4d3014b0e7d9ec558.jpeg', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">The <span style=\"color:#ff6842\"><u><strong>Vice President</strong></u></span> takes the place of the President when the office of the President falls vacant <span style=\"color:#ff6842\"><u><strong>temporarily</strong></u></span> on account of any of the following:</span></span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">If the President is unwell.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">If the President has resigned.</span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">If the President is away from the country.</span></span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">If the President dies &amp; the new President is yet to be elected.</span></span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\">The Vice President is<span style=\"color:#ff6842\"><u><strong> elected </strong></u></span>by the members of both houses of Parliament.The Vice President is the<span style=\"color:#ff6842\"><u><strong> chairperson </strong></u></span>of the <span style=\"color:#ff6842\"><u><strong>Rajya Sabha</strong></u></span>.</span></span></span></p>', '2021-08-08 14:38:09'),
(125, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Prime Minister', 'eae1a942e2c912569371b8412eca5898.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Prime Minister</strong></u></span> is the <span style=\"color:#ff6842\">key person</span><span style=\"color:#ff6842\"><u><strong> </strong></u></span>both in the Executive &amp; the Legislature.He or she is the <span style=\"color:#ff6842\"><u><strong>Head of the Executive</strong></u></span>.He or she has a position of great power &amp; importance.The Prime Ministers position is the most <span style=\"color:#ff6842\"><u><strong>important</strong></u></span> position in the country.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Prime Minister has the <span style=\"color:#ff6842\"><u><strong>exclusive right</strong></u></span> to select the team of Ministers that will form the Council of Ministers &amp; the list of Ministers is submitted to the<span style=\"color:#ff6842\"><u><strong> President</strong></u></span> who <span style=\"color:#ff6842\"><u><strong>approves</strong></u></span> it. All Ministers must be members of either house of Parliament.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Prime Minister has a <span style=\"color:#ff6842\"><u><strong>pivotal role</strong></u></span>. The Council of Ministers, with the Prime Minister at the head, is collectively responsible to the <span style=\"color:#ff6842\"><u><strong>Lok Sabha</strong></u></span>. The Council&rsquo;s advice to the President is conveyed only by the Prime Minister. The Prime Minister is the<span style=\"color:#ff6842\"><u><strong> link </strong></u></span>between the<span style=\"color:#ff6842\"><u><strong> Ministry &amp; President</strong></u></span>, on one hand, &amp; the ministry &amp; Parliament, on the other.</span></span></p>', '2021-08-08 14:45:23'),
(127, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Council of Ministers', 'c75b4caa8fb04c45e98c64d0bcf196a9.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Council of Ministers </strong></u></span>is the most<span style=\"color:#ff6842\"><u><strong> powerful</strong></u></span> organ of the <span style=\"color:#ff6842\"><u><strong>Union Executive</strong></u></span>. It is headed by the <span style=\"color:#ff6842\"><u><strong>Prime Minister</strong></u></span> &amp; includes: </span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Ministers with Cabinet Rank (the Senior Ministers)</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Ministers of State</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Deputy Ministers</span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Ministers are <span style=\"color:#ff6842\"><u><strong>appointed </strong></u></span>by the <span style=\"color:#ff6842\"><u><strong>President </strong></u></span>on the advice of the Prime Minister. Each Minister is <span style=\"color:#ff6842\"><u><strong>allotted</strong></u></span> one or more departments, like finance, railways, defence, health, communication, etc. This is called allotment of <span style=\"color:#ff6842\"><u><strong>portfolios</strong></u></span>.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Prime Minister decides which portfolio should be given to which Minister. The Council is collectively <span style=\"color:#ff6842\"><u><strong>responsible</strong></u></span> to <span style=\"color:#ff6842\"><u><strong>Parliament</strong></u></span>. They can continue to hold office as long as they enjoy the confidence of Parliament.</span></span></p>', '2021-08-08 14:53:30'),
(128, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Functions of the Council', '6d5ce90a7fd4ab8b83e06cfa00db6cbc.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Council of Ministers</strong></u></span> formulate concrete proposals for<span style=\"color:#ff6842\"><u><strong> legislation</strong></u></span>. Together with the Prime Minister, the Council aids &amp; <span style=\"color:#ff6842\"><u><strong>advices</strong></u></span> the President in his or her <span style=\"color:#ff6842\"><u><strong>functions</strong></u></span>. Within the Council the senior ministers with Cabinet rank from the Cabinet. The Cabinet is the <span style=\"color:#ff6842\"><u><strong>nucleus</strong></u></span> of the Council.</span></span></p>', '2021-08-08 14:57:04'),
(130, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Important Powers of the Council', '42dfc5f0f1b48725f7e17420c9e39b7e.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The<span style=\"color:#ff6842\"><u><strong> impeachment</strong></u></span> of the President.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Removal </strong></u></span>of the Vice President.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Removal of a judge of the Supreme Court or the High Courts.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>Amendments</strong></u></span> of the Constitution.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>empowering </strong></u></span>parliament to create an all India Service.</span></span></li>\r\n</ul>', '2021-08-08 15:15:39'),
(131, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Judiciary', '9348697944750c07ae90cdcdb7d82d26.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The<span style=\"color:#ff6842\"><u><strong> Judiciary of India</strong></u></span> is an <span style=\"color:#ff6842\"><u><strong>Independent</strong></u></span> body &amp; is separate from the Executive &amp; Legislative bodies of the Indian Government. The Judicial system of India is stratified into various levels as followed:</span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">At the apex is the <span style=\"color:#ff6842\"><u><strong>Supreme Court</strong></u></span>,</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Which is followed by <span style=\"color:#ff6842\"><u><strong>High Courts</strong></u></span> at the state level,</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#ff6842\"><u><strong>District Courts</strong></u></span>at the district level &amp; <span style=\"color:#ff6842\"><u><strong>Lok Adalats</strong></u></span> at the village &amp; panchayat Level.</span></span></li>\r\n</ul>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Judiciary of India takes care of maintenance of <span style=\"color:#ff6842\"><u><strong>law &amp; order</strong></u></span> in the country along with solving problems related to Civil &amp; Criminal Offences. The Judiciary system that is followed in India is based on the<span style=\"color:#ff6842\"><u><strong> British Legal System </strong></u></span>that was prevalent in the country during <span style=\"color:#ff6842\"><u><strong>pre-independence </strong></u></span>era. Very few <span style=\"color:#ff6842\"><u><strong>amendments </strong></u></span>have been made in the judicial system of the country.</span></span></p>', '2021-08-09 06:50:53'),
(132, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The Supreme Court', 'cc451d652e933380fe183e6fdd028054.jpeg', '<p><span style=\"font-size:18px\"><span style=\"background-color:white\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\"><span style=\"color:#ff6842\"><u><strong>Supreme Court </strong></u></span><span style=\"color:black\">at the </span><span style=\"color:#ff6842\"><u><strong>apex</strong></u></span><span style=\"color:black\"> of the Indian Judiciary is the </span><span style=\"color:#ff6842\"><u><strong>highest authority </strong></u></span><span style=\"color:black\">to uphold the Constitution of India, to protect the rights and liberties of the citizens, and to uphold the values of rule of law. Hence, it is known as the<em><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span></em></span><em><span style=\"color:#ff6842\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\"><u><strong>Guardian of our Constitution</strong></u></span></span></em><span style=\"color:black\"><em><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">. &nbsp;</span></em></span></span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:black\">The Indian Constitution provides for a provision of the Supreme Court under Part V (The Union) and Chapter 6 titled </span><span style=\"color:#ff6842\"><u><strong>&#39;The Union Judiciary&#39;</strong></u></span><span style=\"color:black\">.&nbsp; The Constitution of India has provided an independent judiciary with a </span><span style=\"color:#ff6842\"><u><strong>hierarchical</strong></u></span><span style=\"color:black\"> setup containing </span><span style=\"color:#ff6842\"><u><strong>High Courts</strong></u></span><span style=\"color:black\"> and </span><span style=\"color:#ff6842\"><u><strong>Subordinate Courts </strong></u></span><span style=\"color:black\">under it.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Indian Judicial System has the Supreme Court of India at its helm, which at presents located only in the capital city of <span style=\"color:#ff6842\"><u><strong>Delhi</strong></u></span>, without any benches in any part of the nation, &amp; is<span style=\"color:#ff6842\"><u><strong> presided</strong></u></span> by the <span style=\"color:#ff6842\"><u><strong>Chief Justice </strong></u></span>of India. The<span style=\"color:#ff6842\"><u><strong> President </strong></u></span>appoints the Chief Justice of India &amp; other judges of Supreme Court. By Convention, the senior most judge of Supreme Court is appointed as the Chief Justice.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Judiciary should not work under any kind of pressure. The independence of Judiciary is maintained so as to enable the judges to <span style=\"color:#ff6842\"><u><strong>fearlessly</strong></u></span> carry out the function of giving <span style=\"color:#ff6842\"><u><strong>justice. </strong></u></span></span></span></p>', '2021-08-09 07:14:05'),
(133, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Functions Of Supreme Court', '19ce21a33c84f39637ac9a02a1d68ee7.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">As a <span style=\"color:#ff6842\"><u><strong>federal </strong></u></span>court, it has the responsibility to settle <span style=\"color:#ff6842\"><u><strong>disputes </strong></u></span>between the<span style=\"color:#ff6842\"><u><strong> Union </strong></u></span>&amp; the<span style=\"color:#ff6842\"><u><strong> states</strong></u></span>; between the states &amp; the Union &amp; any state on one hand &amp; one or more states on the other hand.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">It may also give orders for<span style=\"color:#ff6842\"><u><strong> protection</strong></u></span> of the <span style=\"color:#ff6842\"><u><strong>fundamental rights</strong></u></span> of citizen.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">To <span style=\"color:#ff6842\"><u><strong>review </strong></u></span>decrees &amp; orders of lower courts &amp; also review its own <span style=\"color:#ff6842\"><u><strong>decisions</strong></u></span>.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In case the <span style=\"color:#ff6842\"><u><strong>President</strong></u></span> asks for the advice of the court to understand the <span style=\"color:#ff6842\"><u><strong>legal </strong></u></span>aspects in matters of public importance, provide the necessary<span style=\"color:#ff6842\"><u><strong> advice.</strong></u></span></span></span></li>\r\n</ul>', '2021-08-09 11:36:19'),
(134, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The High Court', '2db609e0c20fb477da20afd9e0e02120.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>High Court</strong></u></span> are also termed as the<span style=\"color:#ff6842\"><u><strong> courts of equity</strong></u></span>, &amp; can be approached in writs not only for <span style=\"color:#ff6842\"><u><strong>violation</strong></u></span> of <span style=\"color:#ff6842\"><u><strong>fundamental rights</strong></u></span> under the provisions of Article 32 of the Indian Constitution, but also for any other rights under Article 226 of the Constitution. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">High Courts frame their <span style=\"color:#ff6842\"><u><strong>own rules</strong></u></span>, &amp; arrange to implement them but under certain provisions of <span style=\"color:#ff6842\"><u><strong>Law</strong></u></span>, the High Courts have the ordinary original <span style=\"color:#ff6842\"><u><strong>civil jurisdiction</strong></u></span>. </span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Indian Union</strong></u></span> of states confers the Parliament with the power to establish a High Court in each Constituent State in the Union currently there are 24 High courts in India. There is a <span style=\"color:#ff6842\"><u><strong>Chief Justice</strong></u></span> along with other judges in the High Court. All Judges of the High Court are <span style=\"color:#ff6842\"><u><strong>appointed</strong></u></span> by the<span style=\"color:#ff6842\"><u><strong> President</strong></u></span>.</span></span></p>', '2021-08-09 07:27:47'),
(135, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'Functions of the High Court', '7ae1d1c559dd8924b24a2c16d48a4daa.jpeg', '<ul>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">To <span style=\"color:#ff6842\"><u><strong>supervise &amp; maintain</strong></u></span> control over the lower courts in its jurisdiction.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Authority to give <span style=\"color:#ff6842\"><u><strong>orders </strong></u></span>to protect fundamental rights.</span></span></li>\r\n	<li><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The Governor seeks the<span style=\"color:#ff6842\"><u><strong> advice </strong></u></span>of the High Court while appointing judges in the district Courts.</span></span></li>\r\n</ul>', '2021-08-09 11:36:40'),
(136, 'All About Indian Government', '9d1bf33bd8d119b6fc79f3f4c1dc8899.jpeg', 'The District Court', '8d4c39dfb86557df789077e0d6f1e6d9.jpeg', '<p><span style=\"font-size:18px\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#0d0d0d\">All of us must have heard the word </span><span style=\"color:#ff6842\"><u><strong>&ldquo;trial&rdquo;,</strong></u></span><span style=\"color:#0d0d0d\"> and as for law students concern, the art of trial is something which everyone would be interested to learn. All trial commences at</span><span style=\"color:#ff6842\"><u><strong> district Court.</strong></u></span><span style=\"color:#0d0d0d\">&nbsp; Except for few cases, every</span><span style=\"color:#ff6842\"><u><strong> case<span style=\"color:#0d0d0d\"> </span>starts</strong></u></span><span style=\"color:#0d0d0d\"> with the district court first, and the actual trial regarding factual circumstances is seen in the district or </span><span style=\"color:#ff6842\"><u><strong>session courts</strong></u></span><span style=\"color:#0d0d0d\">, that is why this type of subordinate courts plays a very </span><span style=\"color:#ff6842\"><u><strong>vital role</strong></u></span><span style=\"color:#0d0d0d\"> in delivering </span><span style=\"color:#ff6842\"><u><strong>justice </strong></u></span><span style=\"color:#0d0d0d\">to people.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#0d0d0d\">Every district have a district court, and in some situation, one or more districts together have a single district court and it depends on certain factors like the number of cases dealt, or the population distribution in that particular district. Every court at the district level&nbsp;is </span><span style=\"color:#ff6842\"><u><strong>Chaired </strong></u></span><span style=\"color:#0d0d0d\">by a </span><span style=\"color:#ff6842\"><u><strong>district judge</strong></u></span><span style=\"color:#0d0d0d\">. Their main objective is to administer justice at the</span><span style=\"color:#ff6842\"><u><strong> local level</strong></u></span><span style=\"color:#0d0d0d\">. These Subordinates courts are under</span><span style=\"color:#ff6842\"><u><strong> administrative </strong></u></span><span style=\"color:#0d0d0d\">and judicial</span><span style=\"color:#ff6842\"><u><strong> control</strong></u></span><span style=\"color:#0d0d0d\"> of Apex judicial body of the State, i.e., the</span><span style=\"color:#ff6842\"><u><strong> High Court</strong></u></span><span style=\"color:#0d0d0d\">. There is a total of 672 District courts in India at present. Also, the ruling of the &nbsp;District Court is under the subject of the </span><span style=\"color:#ff6842\"><u><strong>appellate jurisdiction </strong></u></span><span style=\"color:#0d0d0d\">of the High court.</span></span></span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-08-09 07:55:00'),
(137, 'Bill Gates', '031a4feed33690cbf6dd34c7eb5fdffd.jpeg', 'Who is he?', '973a11e897316401b738e374fc8e717c.jpeg', '<p><span style=\"background-color:white\"><span style=\"color:#212121; font-family:Calibri,sans-serif; font-size:18px\">Some see him as an </span><span style=\"color:#ff6842; font-family:Calibri,sans-serif; font-size:18px\"><u><strong>innovative</strong></u></span><span style=\"color:#212121; font-family:Calibri,sans-serif; font-size:18px\"> visionary who sparked a computer </span><span style=\"color:#ff6842; font-family:Calibri,sans-serif; font-size:18px\"><u><strong>revolution.</strong></u></span><span style=\"color:#212121; font-family:Calibri,sans-serif; font-size:18px\"> Others see him as a modern-day </span><span style=\"color:#ff6842; font-family:Calibri,sans-serif; font-size:18px\"><u><strong>robber baron </strong></u></span><span style=\"color:#212121\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\">whose predatory practices have stifled competition in the software industry. Regardless of what his supporters and detractors may think, few can argue that</span></span></span><span style=\"color:#ff6842\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:18px\"><u><strong>&nbsp;</strong></u></span></span><u><strong><span style=\"font-size:18px\">Bill Gates&nbsp;</span></strong></u></span></span><span style=\"color:#ff6842\"><span style=\"font-size:11.0pt\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\">&nbsp;</span></span></span><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">is one of, if not the most successful </span><span style=\"color:#ff6842\"><u><strong>entrepreneur </strong></u></span><span style=\"color:#212121\">of the 20th century. In just 25 years, he built a two-man operation into a </span><span style=\"color:#ff6842\"><u><strong>multibillion-dollar</strong></u></span><span style=\"color:#212121\"> colossus and made himself the</span><span style=\"color:#ff6842\"><u><strong> richest</strong></u></span><span style=\"color:#212121\"> man in the world from </span></span></span><span style=\"background-color:white\"><span style=\"font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;\"><span style=\"color:#202124\">1995 to 2017</span></span></span><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">. Yet he accomplished this feat not by inventing new technology, but by taking existing</span><span style=\"color:#ff6842\"><u><strong> technology</strong></u></span><span style=\"color:#212121\">, adapting it to a specific market, and then </span><span style=\"color:#ff6842\"><u><strong>dominating</strong></u></span><span style=\"color:#212121\"> that market through innovative promotion and cunning business savvy.</span></span></span></span></p>', '2021-08-12 10:42:24'),
(138, 'Bill Gates', '031a4feed33690cbf6dd34c7eb5fdffd.jpeg', 'Early Life', '10cc022c74ce6ba0fd669ac8c7325a60.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">For Bill&rsquo;s studies&nbsp; his parents, got him admitted to Lakeside School, which was one of the best&nbsp; Seattle&rsquo;s School. From early age, Bill was interested in</span><span style=\"color:#ff6842\"><u><strong> Computers</strong></u></span><span style=\"color:#212121\"> &amp; too was a very </span><span style=\"color:#ff6842\"><u><strong>intelligent</strong></u></span><span style=\"color:#212121\"> student in School.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">In 1969, the company named </span><span style=\"color:#ff6842\"><u><strong>Seattle</strong></u></span><span style=\"color:#212121\">, who sold Computers, sold some Computers to School &amp; because of this Bill used to spend most of his time in Computer Lab only &amp; then he met</span><span style=\"color:#ff6842\"><u><strong> Paul Allen</strong></u></span><span style=\"color:#212121\">, they both were completely different from each other&nbsp; but share a common interest in Computers.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">In 1970, when Bill was 15, with help of Paul, they created a Computer Program named as &lsquo;</span><span style=\"color:#ff6842\"><u><strong>Traf-O-Data</strong></u></span><span style=\"color:#212121\"> which was used to measure the traffic in the Seattle City for which they earned an amount of $20,000, which was their first income. And then with this, he entered in the field of</span><span style=\"color:#ff6842\"><u><strong> technology</strong></u></span><span style=\"color:#212121\">.</span></span></span></span></p>', '2021-08-12 10:42:24'),
(139, 'Bill Gates', '031a4feed33690cbf6dd34c7eb5fdffd.jpeg', 'Career Life', 'b298e1d8e5b089c4eee5659a9045023c.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">In 1972, when&nbsp; Bill was just 17 thought &amp; start making plans with Paul to open a company of their own. But however Bill&rsquo;s father wanted him to complete his education &amp; be a lawyer. So, Bill completed&nbsp; his High School in 1973. After that he got admission in </span><span style=\"color:#ff6842\"><u><strong>Harvard University</strong></u></span><span style=\"color:#212121\"> for the further law studies but he was not much dedicated in law as he was in Computer.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">In 1974, Allen got a magazine named &lsquo;Popular Electronics&rsquo; in which the cover page contain the advertise of the very first Mini Computer</span><span style=\"color:#ff6842\"><u><strong> &lsquo;ALTAR 800 COMPUTER&rsquo; </strong></u></span><span style=\"color:#212121\">whose owner was looking for someone to create a software, so it can work with that computer. This was the</span><span style=\"color:#ff6842\"><u><strong> opportunity</strong></u></span><span style=\"color:#212121\"> Bill didn&rsquo;t miss &amp; created a basic </span><span style=\"color:#ff6842\"><u><strong>software </strong></u></span><span style=\"color:#212121\">in the lab of Harvard University with the help of Allen, continuously for two months. After that, when Allen went for the test of software in Feb&rsquo;1975, it fit perfectly with the &lsquo;ALTAR 800 COMPUTER&rsquo; &amp; this was the best moment of their life. This impact was a</span><span style=\"color:#ff6842\"><u><strong> history</strong></u></span><span style=\"color:#212121\"> in the field of Computer Business.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">At the age of 19, Bill &amp; his friend Allen started the</span><span style=\"color:#ff6842\"><u><strong> Microsoft Company.</strong></u></span></span></span></span></p>', '2021-08-17 08:23:18'),
(140, 'Bill Gates', '031a4feed33690cbf6dd34c7eb5fdffd.jpeg', 'Microsoft', '6c9a1f24b3800ec71010ad93282c45ad.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">The <span style=\"color:#ff6842\"><u><strong>Microsoft</strong></u></span> Company by Bill &amp; Allen was started in April,1975. They started to work with other Ed R Company. Soon the<span style=\"color:#ff6842\"><u><strong> rise </strong></u></span>of Computer was much in market that Bill drop his studies before getting graduate.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">Bill&rsquo;s hardwork lead to company&rsquo;s great<span style=\"color:#ff6842\"><u><strong> success</strong></u></span>. And then Microsoft program a new <span style=\"color:#ff6842\"><u><strong>software</strong></u></span> in different languages &amp; started selling them to other Computer Companies. From 1978 to 1981, there was a rise in graph of the Microsoft Company. Its employee number went from 8 to 138 members.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1980, the <span style=\"color:#ff6842\"><u><strong>turnover</strong></u></span> point came when the biggest <span style=\"color:#ff6842\"><u><strong>IBM company</strong></u></span> of computers proposed Bills Microsoft Company to make a software for their new computer. After making such a software, IBM provided Microsoft $50,000 for the software but Bill Gates was a<span style=\"color:#ff6842\"><u><strong> clever &amp; intelligent</strong></u></span>, business man too. He asked IBM to give money on every Single Computer in which they are inserting the software i.e. licensed fee. Then Bill Gates&nbsp; became the President &amp; Allen the Vice President of The Microsoft Company.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1983, almost 30% of the Worlds computer have Microsoft Software installed in it. In 1984, Allen got ill due to which he left the partnership with Bill. In 1985, Bill alone was the face of Microsoft &amp; the Company&rsquo;s net worth reached to $140 Million.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1986, Bill created<span style=\"color:#ff6842\"><u><strong> Microsoft Windows</strong></u></span>, which can be easily operated with the help of Mouse. He kept with himself the 45% stock of the company which made him the <span style=\"color:#ff6842\"><u><strong>Billionaire</strong></u></span> at the age of 31.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\">In 1987, Gates was one of the <span style=\"color:#ff6842\"><u><strong>youngest </strong></u></span>billionaire of the world. In the same year, he lost his biggest customer, IBM Company as they&nbsp; made a software of their own.&nbsp; But Bill gates didn&rsquo;t give up &amp; believed in himself &amp; by the age of 42, became the<span style=\"color:#ff6842\"><u><strong> richest person </strong></u></span>of the world.</span></span></p>', '2021-08-17 08:33:05'),
(141, 'Bill Gates', '031a4feed33690cbf6dd34c7eb5fdffd.jpeg', 'Microsoft Windows', 'eb3a357ba472087268ea33c2c8e8751d.jpeg', '<p><span style=\"font-size:18px\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#212121\">When </span><span style=\"color:#ff6842\"><u><strong>Apple </strong></u></span><span style=\"color:#212121\">introduced the first </span><span style=\"color:#ff6842\"><u><strong>Macintosh</strong></u></span><span style=\"color:#212121\"> computer. The Macintosh&#39;s sleek graphical user interface (GUI) was far</span><span style=\"color:#ff6842\"><u><strong> easier</strong></u></span><span style=\"color:#212121\"> to use than MS-DOS and </span><span style=\"color:#ff6842\"><u><strong>threatened </strong></u></span><span style=\"color:#212121\">to make the Microsoft program obsolete. In response to this threat, Gates announced that Microsoft was developing its own GUI-based operating system called </span><span style=\"color:#ff6842\"><u><strong>Windows</strong></u></span><span style=\"color:#212121\">. Gates then took Microsoft public in 1986 to generate capital. The IPO was a roaring success, raising $61 million and making Gates one of the</span><span style=\"color:#ff6842\"><u><strong> wealthiest</strong></u></span><span style=\"color:#212121\"> people in the country</span><span style=\"color:#ff6842\"><u><strong> overnight</strong></u></span><span style=\"color:#212121\">.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#212121\">When Windows was finally released in 1985, it wasn&#39;t exactly the breakthrough Gates had predicted. </span><span style=\"color:#ff6842\"><u><strong>Critics</strong></u></span><span style=\"color:#212121\"> claimed it was slow and cumbersome. Apple wasn&#39;t exactly pleased either. They saw Windows as a rip-off of the Macintosh operating system and </span><span style=\"color:#ff6842\"><u><strong>sued</strong></u></span><span style=\"color:#212121\">. The case would drag on until the mid-1990s, when the courts finally decided that Apple&#39;s suit had </span><span style=\"color:#ff6842\"><u><strong>no merit</strong></u></span><span style=\"color:#212121\">.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:#212121\">Meanwhile, Gates worked on </span><span style=\"color:#ff6842\"><u><strong>improving </strong></u></span><span style=\"color:#212121\">Windows. Subsequent </span><span style=\"color:#ff6842\"><u><strong>versions</strong></u></span><span style=\"color:#212121\"> of the program ran faster and froze less frequently. Third-party programmers began </span><span style=\"color:#ff6842\"><u><strong>developing</strong></u></span><span style=\"color:#212121\"> Windows-based programs, and Microsoft&#39;s own applications became hot sellers. By 1993, Windows was selling at a rate of 1 million copies per month and was estimated to be running on nearly 85 percent of the world&#39;s computers.</span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#212121\">Microsoft solidified its industry </span><span style=\"color:#ff6842\"><u><strong>dominance</strong></u></span><span style=\"color:#212121\"> in the mid-1990s by combining Windows with its other applications into &quot;</span><span style=\"color:#ff6842\"><u><strong>suites</strong></u></span><span style=\"color:#212121\">&quot; and persuading leading computer makers to preload their software on every computer they sold. The</span><span style=\"color:#ff6842\"><u><strong> strategy</strong></u></span><span style=\"color:#212121\"> worked so well that by 1999 Microsoft was posting sales of $19.7 billion, and Gates&#39; personal wealth had grown to a phenomenal $90 billion.</span></span></span></span></span></p>', '2021-08-17 08:42:55'),
(142, 'Bill Gates', '031a4feed33690cbf6dd34c7eb5fdffd.jpeg', 'Personal Life', '8af6044e3f418793948e24417be380fc.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\">Gates married <span style=\"color:#ff6842\"><u><strong>Melinda French</strong></u></span> on the Hawaiian Island of Lanai on January 1, 1994. They met in 1987 after Melinda began working at Microsoft. At the time of their marriage, Gates was given permission by Melinda to spend limited time with his ex-girlfriend, businesswoman Ann Winblad. Bill and Melinda have three <span style=\"color:#ff6842\"><u><strong>children</strong></u></span>: Jennifer, Rory and Phoebe. The family&#39;s residence is an earth-sheltered <span style=\"color:#ff6842\"><u><strong>mansion</strong></u></span> in the side of a hill overlooking Lake Washington in Medina, Washington.</span></span></span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\">In a surprising development, billionaire couple Bill and Melinda Gates on Monday (May 3) announced that they have decided to divorce each other after 27 years of marriage, saying &lsquo;we no longer believe we can grow together as a couple&rsquo;. The duo released an official statement on Twitter confirming the same and said, &ldquo;After a great deal of thought and a lot of work on our relationship, we have made the decision to end our marriage. We have raised three incredible children and built a foundation that works all over the world to enable all people to lead healthy, productive lives.&rdquo;</span></span></span></p>', '2021-08-18 03:57:41'),
(143, 'Bill Gates', '031a4feed33690cbf6dd34c7eb5fdffd.jpeg', 'Bill & Melinda Gates Foundation', '27bfc93d2ba4b6d10bca16d2916e1b17.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"background-color:white\"><span style=\"color:#202122\">It was </span><span style=\"color:#ff6842\"><u><strong>launched</strong></u></span><span style=\"color:#202122\"> in 2000 and is reported as of 2020 to be the second largest </span><span style=\"color:#ff6842\"><u><strong>charitable foundation</strong></u></span><span style=\"color:#202122\"> in the world,holding $49.8 billion in assets. </span><span style=\"color:#202124\">Guided by the belief that every life has </span><span style=\"color:#ff6842\"><u><strong>equal value,</strong></u></span><span style=\"color:#202124\"> the&nbsp;</span><span style=\"color:#ff6842\"><u><strong>Bill</strong>&nbsp;&amp;&nbsp;<strong>Melinda Gates Foundation</strong></u></span><span style=\"color:#202124\">&nbsp;works to help all people lead healthy, productive lives. In developing countries, it focuses on improving people&#39;s</span><span style=\"color:#ff6842\"><u><strong> health </strong></u></span><span style=\"color:#202124\">and giving them the chance to lift themselves out of hunger and extreme </span><span style=\"color:#ff6842\"><u><strong>poverty.</strong></u></span></span></span></span></p>', '2021-08-18 04:02:19'),
(144, 'Steve Jobs', 'd23c1725f45fae1a46c356583f6b8340.jpeg', 'Who is he?', '1d2893af43065aab9c4b715c9c82aae6.jpeg', '<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">Often heard that <span style=\"color:#ff6842\"><u><strong>Steve Jobs</strong></u></span> had such a <span style=\"color:#ff6842\"><u><strong>rude </strong></u></span>and abrasive personality trait that he would <span style=\"color:#ff6842\"><u><strong>yell </strong></u></span>at his colleagues and team anytime if things didn&rsquo;t go well or according to his <span style=\"color:#ff6842\"><u><strong>expectations</strong></u></span>.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">There have been a lot of instances where he embarrassed people in interviews.&nbsp;If things are not of his <span style=\"color:#ff6842\"><u><strong>standards</strong></u></span>, he will <span style=\"color:#ff6842\"><u><strong>leave</strong></u></span> it. Be it a hotel or anything else.&nbsp;&nbsp;He believed that anyone can tell him that he is full of shit and vice-versa.&nbsp;&nbsp;His <span style=\"color:#ff6842\"><u><strong>cantankerous </strong></u></span>nature has led the <span style=\"color:#ff6842\"><u><strong>creator </strong></u></span>of the outstanding retail stores; Rob Johnson and the vice president of Global Marketing leave their respective positions.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-family:&quot;Times New Roman&quot;,&quot;serif&quot;\">There is always something positive in everything, and maybe this personality trait of Steve Jobs made him what we know him for today because had he allowed others&rsquo; <span style=\"color:#ff6842\"><u><strong>influence </strong></u></span>on his <span style=\"color:#ff6842\"><u><strong>vision</strong></u></span>, he might not have become the Steve Jobs we all <span style=\"color:#ff6842\"><u><strong>admire</strong></u></span>.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Steve Jobs&rsquo; company was the first one to replace a five-inch floppy disc with 3 and a half inch floppy disc and it was <span style=\"color:#ff6842\"><u><strong>Apple </strong></u></span>which got rid of the optical drive with <span style=\"color:#ff6842\"><u><strong>MAC book AIR</strong></u></span>. It was indeed the first company to adopt USB. It was Apple.</span></span></p>\r\n\r\n<p><span style=\"font-size:18px\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\">Steve Jobs wanted to get rid of the keyboard and replace it with <span style=\"color:#ff6842\"><u><strong>multi-touch display </strong></u></span>and we all know how Apple works. He wished to have an <span style=\"color:#ff6842\"><u><strong>elegant design </strong></u></span>and a<span style=\"color:#ff6842\"><u><strong> simple user interface </strong></u></span>and he successfully got his vision implemented with his products. He was <span style=\"color:#ff6842\"><u><strong>against </strong></u></span>the approach of <span style=\"color:#ff6842\"><u><strong>Microsoft,</strong></u></span> which runs its OS on multiple platforms and so he reduced his software to run on Apple products.</span></span></p>\r\n\r\n<p>&nbsp;</p>', '2021-08-18 04:16:05');
