(61, '7cadac17e9cc6190efca20b5fe217038.jpg', '9507010c67048dd5b7d6f0704431810e.jpg', 'f89dc6650dff615be7959e94ddafe93a.jpg', '5838f2bb1c2fb828ad6923431673d98c.jpg', '91379741285a8fbcd724068a63f87d7b.jpg', NULL, 'chef.svg', 'Hello Home Chef', 'Food', 'Every day we make things happen, and while we are busy, we look forward to eat homemade, freshly cooked meals. Guilty free taste with the happiness of health. Thats why our Founder & CEO, Kamal Vaswani created HelloHomeChef: to provide delicious and nutritious meals available at your fingertips, no matter how busy you are.++\r\n\r\nAt HelloHomeChef, each meal is cooked by home chefs in their home kitchen with quality ingredients, following high practices of sanitization and above all cooked with 1 teaspoon of love.++\r\n\r\nEach morsel of food ordered from HelloHomeChef is an experience of home-made delicacy. Weve our chefs from all corners of India to bring national and international taste on your plate. Not to forget, few cuisines may remind you your childhood food, ma ke hath ka khana. A wide variety from the hills of Kashmir and Punjab in North to the Gods own country cuisine, Kerala in South; the taste of Bengal in the East to the Gujrat and Maharashtra in the West, weve covered all, so that you do not miss on any food.+\r\nAuthentic.+\r\nSweets', ' A bridge between Chefs, cloud kitchens and consumers to find variety of cuisines under one roof.+\r\n An eligible chef can start their food business from our support.', 'Andheri', 'HHC FOODTECH, Ackruti Softech Park, MIDC, Andheri East, Mumbai.', NULL, NULL, NULL, NULL, NULL, 'Kamal Vaswani', NULL, NULL, NULL, NULL, NULL, NULL, 'Symbiosis', NULL, NULL, '+91 9967857663', NULL, NULL, NULL, 'https://www.hellohomechef.com/', NULL, NULL, 'info@hellohomechef.com', 'https://www.facebook.com/hellohomechef', 'https://www.instagram.com/_hellohomechef/', 'https://www.linkedin.com/company/hellohomechef/', NULL, NULL, 'https://twitter.com/HelloHomeChef1', NULL, NULL, 'https://www.youtube.com/channel/UCIRtUjEN5aJRJHyD_qQNj2Q', NULL, NULL, NULL, NULL, NULL, NULL, '2021-10-09 17:09:42'),
